INSERT INTO `dataset` (`Id`,`Question`,`Answer`,`URL`) VALUES 
 (1,'my 5 1/2-year-old son displays adhd symptoms for 20 days then for 10 days he has none. is it adhd or another condition?','adhd and bipolar mood disorder (bmd) can coexist or be mistaken for one another. bmd usually is not diagnosed until young adulthood. however studies have shown that the earlier a person is diagnosed with bmd the more likely he is to have been diagnosed with adhd previously. in this case i would just like to reiterate that there is not enough information to discuss either possibility for your son. you mentioned that he becomes hyperactive for 3 weeks but not what his behaviors are like during those 10 days. you also do not mention irritability or mood swings just adhd symptoms. keep documenting the symptoms you are concerned about including what goes on in the home and at school when you see changes in behavior (do you work those weeks does he visit a relative or have a different aide in the classroom). you also mentioned that this began 7 months ago. i would also urge you to think about what also might have changed in your son\'s life about that time. consulting your pediatrician or a child psychiatrist should help you unravel the mystery of your son\'s behavior.','http://answers.webmd.com/answers/1194205/my-5-1-2-year-old-son-displays-adhd'),
 (2,'my son has add and mild autism. he has been successfully on concerta for 6+ years. can you help with his weight loss?','stimulants in general tend to decrease appetite in certain not all children. over time this side effect seems to lessen but as in the case of your son for some children it may persist. weight loss is the result of this appetite decrease and not consuming enough calories during the day. therefore since the medication is effective and at \"the perfect dose for him \" right now i would suggest that you work on increasing your son\'s calorie intake. this however is often not an easy task! some suggestions include offering your son his preferred foods whenever he seems hungry; starting the day with a large calorie-laden breakfast early in the morning before the medication takes effect; increasing the calories in snacks during the day and at bedtime; and adding a high calorie supplement like ensure or shakes with ice cream etc. during the day. consult your pediatrician or a nutrionist to determine how many calories a day your son should be consuming and try to make sure this is the minimum he consumes to prevent weight loss. if you find this remains a problem i suggest you consult a pediatric nutritionist for additional suggestions. if the problems persists despite you and your son\'s best efforts you may want to discuss changing to a non-stimulant medication with your son\'s prescribing physician.','http://answers.webmd.com/answers/1194206/my-son-has-add-and-mild'),
 (3,'my son is 13 and is depressed. he has been taking vyvanse for the last 3 years and never had a problem. can you help?','while any of the stimulant medications can increase depressive symptoms. it\'s important to pay attention to this change in your son\'s mood and take him to a mental health professional for an assessment. children diagnosed with attention deficit/hyperactivitydisorder (adhd) at early are more likely to suffer from depression as adolescents than those who did not have adhd according to a long-term study published in the october issue of the archives of general psychiatry. although it was an uncommon occurrence the children with adhd also were somewhat more likely to think about or attempt suicide as adolescents. the study performed by researchers at the university of chicago and the university of pittsburgh followed 123 children diagnosed with adhd at age 4 to 6 for up to 14 years until they reached ages 18 to 20. it compared them with 119 children from similar neighborhoods and schools matched for age sex and ethnicity. the researchers found that 18 percent of children diagnosed early with adhd suffered from depression as adolescents about 10 times the rate among those without adhd. children with early adhd were five times as likely to have considered suicide at least once and twice as likely to have made an attempt. please get your son evaluated.','http://answers.webmd.com/answers/1198557/my-son-is-13-and-is'),
 (4,'my 17-year-old has stopped taking concerta after 10 years. what affect will this have on his adhd?','seventy percent of teens diagnosed when they are younger continue to have symptoms of their adhd that affect their functioning as adolescents. once your son stops taking his medication (concerta) his symptoms will return relatively quickly. unless he has learned other compensatory techniques or has outside help his symptoms will affect both his academic performance in school and his relationships with others. if he is driving he may have more difficulty focusing and with distractibility. teens with untreated adhd tend to have more car accidents and get more speeding tickets. all of this should be explained to him and i would suggest that he go in for a visit to discuss this and his decision to stop his medication with his health care provider. i often use this situation as an opportunity for the teen to learn more about how his adhd affects him and why or whether he need to continue his medication to treat his symptoms.','http://answers.webmd.com/answers/1195455/my-17-year-old-has-stopped-taking-concerta'),
 (5,'i\'ve been taking respa-ar for allergies. i can\'t seem to get it refilled. will it be back on the market soon?','try claritin-d which is located behind the pharmacy counter. i\'m not sure if or when respa-ar will be back on the market.','http://answers.webmd.com/answers/1182576/i-ve-been-taking-respa-ar-for-allergies'),
 (6,'what is the role of a pharmacist in a community and how can he/she help a patient?','i am very happy to answer this question. the pharmacist is the medication expert. we go to school for over six years and we focus on medications and how they work. i practice as a community pharmacist and my goal is to make sure my patients are taking their medications correctly protect them from drug interactions provide patient care services like medication therapy management and help them understand their disease. medications have a lot of side effects and can interact with foods over-the-counter medications vitamins and herbals. we should be a resource for you -- after all we are the most accessible health care provider! in many states you can now get your flu vaccination from a pharmacist. we should be a \"vip\" on your trip to the pharmacy. get to know us on a first name basis. (we don\'t bite i promise! ) always ask to speak to the pharmacist when you are picking up or dropping off a prescription; you can get some valuable information. we can advise you of side effects or answer even the most basic question of \"what is this medication for? ” the best part of my day is talking to patients and making a difference.','http://answers.webmd.com/answers/1182574/what-is-the-role-of-a'),
 (7,'my daughter is 15 months old has had severe feeding issuesshe lives on applesauce and fruitmelts and formulatests normal. she has had feeding issues since birth formula refusal throwing up entire bottle 2 to 3 times a day she also has hip dysplsia so far medical test are normal what should i do what is the matter with my baby','get an evaluation asap. you can start with your pediatrician but sure to ask for a feeding evaluation which usually consists of a team of professionals. sometimes doctors will be hesitant if growth is on track but if a child is taking solid food by 12 months that is a red flag. the sooner she gets help the better. good luck!','http://answers.webmd.com/answers/5084550/my-daughter-is-15-months-old-has-had-severe-feeding-issuesshe-lives-on-applesauce-and-fruitmelts-and-formulatests-normal'),
 (8,'does your body know how many calories you eat or can you eat regularly but <1200 cals a day? . i am trying to lose weight. i have always been able to skip eating but now i am eating \"something\" every few hours. i have lost weight but want to lose more. i don\'t want my body to think it is starving if i don\'t adhere to 1200 calories a day. as long as i give my body food every few hours regardless of the caloric content. is that enough to keep metabolizing? one example is: i eat a raw red pepper at about 50 calories for a mid morning snack. it is food in my body but very low in calories.','your body responds to food intake with hunger and fullness. even if you eat every couple of hours if it\'s not enough to fill you up you will likely get hungry. i don\'t know of any way to trick the body. that being said it is beneficial to eat filling foods with fiber like fruits vegetables whole grains and beans. i highly recommend you see a registered dietitian to help get you on the right track. if you lose weight gradually with proper nutrition it will be better for you and much easier to maintain (the hardest part of weight loss). also a dietitian can address any other issues that may be getting in the way of a healthy lifestyle. to find a dietitian in your area go to eatright org. good luck!','http://answers.webmd.com/answers/5083875/does-your-body-know-how-many-calories-you-eat-or-can-you-eat-regularly-but-1200-cals-a-day'),
 (9,'i have trouble swallowing pills. can my prescription be made into a liquid?','some medications are available in liquid formulations. many other medications can be made into a liquid formulation by a compounding pharmacist. be sure to let your health care provider know you have difficulty swallowing medications. they should be able to accommodate you.','http://answers.webmd.com/answers/1182575/i-have-trouble-swallowing-pills-can'),
 (10,'i need a list of foods that i can eat and list of foods to avoid with pancreatitis.','generally a diet free from alcohol and low in fat is recommended for pancreatitis. i recommend you ask your doctor or dietitian how much fat you can consume per day (in grams). that way you can be sure you staying under where you need to be. these are general low fat diet recommendations: no fried foods or foods cooked in a lot of fat. if eating out always ask how the food is prepared. limit nuts seeds oils avocado salad dressings and butter naturally high in fat. you do need some fat but go easy on these items. choose lean meats and low fat dairy products. eat plenty of fruits vegetables and whole grains naturally low in fat. consume small frequent meals as they are more likely to be tolerated. for more tips on low-fat eating see this article.','http://answers.webmd.com/answers/5084356/i-need-a-list-of-foods-that-i-can-eat-and-list-of-foods-to-avoid-with-pancreatitis'),
 (11,'hello. i have heard that a whole foods plant-based diet reduces cancer risk. is this true? . there is a lot of cancer risk in my family but i want to live a long life.','yes plant foods are associated with decreased cancer risk especially fruits vegetables whole grains and legumes. add more of these to your diet while limiting red and processed meats and you\'ll benefit over thelong run. for more on diet and cancer prevention see this webmd article.','http://answers.webmd.com/answers/5083720/hello-i-have-heard-that-a-whole-foods-plant-based-diet-reduces-cancer-risk-is-this-true'),
 (12,'i am on a low carb 1600 calrie diet i am 224 pounds 45 year old male my weight is not coming off? . supplements; protein thermobol glutamine creatine.','it\'s tough to say without more information. here are some possible reasons: you are not at the right calorie level. how did you decide on 1600 calories? a dietitian can help you figure out a meal plan -- and calorie level -- that is individualized to meet your needs. you may be over-consuming calories without knowing it. look for hidden sources of calories in liquids eating out and alcohol. a low-carb diet may not be right for you. everyone is different in how they respond to diets. maybe a change is needed. medications and activity can make a difference. always check with a doctor. your don\'t have much to lose. if you are very tall or always been bigger than average you may not need to lose much weight. if your health is good focus on incorporating and maintaining healthy habits instead. getting help from a registered dietitian can help you get to the root of the issue. for more potential reasons you aren\'t losing weight see this article.','http://answers.webmd.com/answers/5084009/i-am-on-a-low-carb-1600-calrie-diet-i-am-224-pounds-45-year-old-male-my-weight-is-not-coming-off'),
 (13,'what can be absorbed by the stomach? . what percentages of various normally consumed foods and liquids can be absorbed into the body through the stomach. while i understand that the intestines absorb most of the nutrients we consume i was lead to believe that a potion of some foods and beverages were absorbed into the body through the stomach.','the stomach does not absorb nutrients but it does play a role enhancing absorption of certain nutrients in the small intestine. for example the stomach secretes intrinsic factor which binds to b12 for absorption in the small intestine. stomach acid turns iron into a form that is better absorbed in the small intestine. and people who have part of their stomach removed may be at risk for osteoporosis because the stomach empties faster which can decrease the amount of calcium being absorbed and utilized by the body. anyone who has surgery to remove part of the stomach should see a dietitian to be sure they are not at risk for nutrition deficiencies.','http://answers.webmd.com/answers/5084325/what-can-be-absorbed-by-the-stomach'),
 (14,'is it safe to have another baby after i delivered three by c-section?','you can certainly consider having another infant. however all the information in our literature would tell you not to consider having an attempt at a vaginal birth. you are at too high a risk to consider this. i think of myself as very progressive and will always consider a vbac for patients but not someone like you. the issue for you becomes the more c/s you have the higher the risk of possible placental abnormalities. if the placenta lies over the cervix (called a placenta previa) with the number of c/s you have had there could be a significant problem that could occur (called a placenta accreta). you should always discuss with your health care provider your concerns.','http://answers.webmd.com/answers/1189626/is-it-safe-to-have-another'),
 (15,'why does a1c jump up? 6. 2-11. 4. over the last 2 years my a1c has been 7. 8--7. 4--6. 4--6. 2 then this past check-up it jumped to 11. 4. i have never had one that high. i have not changed my diet--i have actually shed about 10 more pounds. i don\'t understand what happened.','there could be a few things going on. first if you don\'t test your blood sugar regularly you don\'t know for sure that they haven\'t increased for some reason. some potential reasons include changes to medication. engaging in more or less exercise and timing and quantity of food/drink intake. if you drank more alcohol on vacation for instance that could cause blood sugar spikes. if you have been checking your blood sugar -- and they have been good-- than i recommend contacting your doctor to see if your a1c was either an error or due to something else. good luck getting to the bottom of this!','http://answers.webmd.com/answers/5078898/why-does-a1c-jump-up-62-114'),
 (16,'bmi of 35. i am 29 a woman who is 4\'11 weigh 178 lbs. my breasts are over dd. i am not fat. how can my range be obese? . i have large hips but they are mostly muscle. my breasts are the only other large fat content place on my body. are there better ways of determining a healthy weight?','bmi is just a classification of weight and not a determinant of health. that being said carrying extra weight can increase health risk. first i would consider your size over time. have you always been this size or have their been increases lately? if this seems to be your normal weight than it may just be where your body wants to be. if it has increased lately you may want to take note of what has changed to see if it has affected your weight. next would be to look at your other health-related numbers. if you cholesterol blood pressure and blood glucose are all normal than those are positive indicators of health. regular exercise and a health diet matter too! lastly where you carry excess weight makes a difference. those who carry fat in the abdomen tend to be at higher risk for chronic disease like diabetes and heart disease. in particular figuring out your waist-hip ratio can help you determine if this is a concern for you (see this article for more information). weight is just one piece of the health puzzle. finding out about all the other pieces can help a great deal!','http://answers.webmd.com/answers/5078806/bmi-of-35-i-am-29-a-woman-who-is-411-weigh-178-lbs-my-breasts-are-over-dd-i-am-not-fat-how-can-my-range-be-obese'),
 (17,'according the the paleo diet experts oatmeal is not good for you because it causes \"inflamation. \" is this true?','some people claim grains -- even whole grains -- cause inflammation. but there is no solid evidence in humans to back this up. people with autoimmune diseases may have difficulty with certain grains especially those with celiac or gi disorders. but for healthy people there is no research to support this point. in fact people who eat lots of plant foods like whole grains tend to have decreased risk of inflammation like vegans <link> oatmeal in particular helps lower cholesterol and keep people full. randomized control studies are needed to prove this \"grains cause inflammation\" theory.','http://answers.webmd.com/answers/5081034/according-the-the-paleo-diet-experts-oatmeal-is-not-good-for-you-because-it-causes-inflamation-is-this-true'),
 (18,'taking a stool softener nightly and a probiotic in am each day? . i am on detrol la for oab. it causes constipation. i had a bad episode in may 2015 and after my dr got me all cleaned he said to take a stool softener to get regular again but i also added a probiotic as well. . i am now having a bm each day but several a day. my question is really are they counter acting each other (stool softener vs. probiotic) - would the probiotic be the best way to go vs. the stool softener to combat the constipation (my fiber intake is better now also via my diet).','i see no reason why they would counter-act each other. i\'m not clear if your doctor wanted you to keep taking the stool softener or just take it to get your bowels moving. often times they are given temporarily. if your fiber intake is up -- and you are having more bms -- you could slowly taper off the stool softener. i would contact your doctor first since he/she prescribed it. probiotics can help with constipation but it depends on the strain.','http://answers.webmd.com/answers/5078892/taking-a-stool-softener-nightly-and-a-probiotic-in-am-each-day'),
 (19,'what vitamins are recommended for a 63-year-old with a spinal cord injury','that will depend on what you are eating and your blood work. people with spinal cord injuries may need additional protein and fiber but that is not contained in vitamins. at regular physicals your health care provider should check things like vitamin d b12 and iron do see if you have any deficiencies. also a registered dietitian can help you determine if you need to make changes to your diet and supplement routine. for more see spinal cord injury: dietary issues','http://answers.webmd.com/answers/5081683/what-vitamins-are-recommended-for-a-63-year-old-with-a-spinal-cord-injury'),
 (20,'i have frequent constipation feeling bloated and have bowel movements around 4-5 days on average. large-hard stools. that are difficult to pass and i\'m asking now because it\'s been getting worse the past year or so and effecting my every-day life. <negative_smiley> what should i do? are probiotic supplements a solution?','any sudden changes in bowels should be checked out by a healthcare provider. here are some things you can do in the meantime: increase fiber: gradually increase fruits vegetables whole grains and beans/legumes. these foods contain fiber that help with constipation. it\'s recommended women (19-50) get 25g of fiber daily and for men (19-50) it\'s 38g. see getting enough fiber. stay hydrated: while increasing fiber make sure you get enough water. when you are dehydrated water is reabsorbed from stool resulting in hard stools. keep active: regular activity also helps relieve constipation. walking dancing and hiking are just a few ideas to keep your body moving. add fermented foods: look for ways to increase foods with probiotics such as yogurt kefir and probioitc drinks. adding a probiotic may help but the research is not clear on this. see probiotics and digestive health. manage stress better: anxiety worry and stress can all affect your gi tract. working on healthy ways to handle daily stressors can help! see stress management.','http://answers.webmd.com/answers/5081696/i-have-frequent-constipation-feeling-bloated-and-have-bowel-movements-around-4-5-days-on-average-large-hard-stools'),
 (21,'lactose intolerance. does lactose build up in your system so as to have issues over a series of several hours/meals? and do acidic foods exacerbate symptoms?','lactose does not build up in your system but the severity of symptoms can be more severe or lasting depending on how much and other foods you ate. if you are having gi discomfort acidic foods may exacerbate your symptoms. for info see lactose intolerance -- topic overview','http://answers.webmd.com/answers/5081725/lactose-intolerance'),
 (22,'how much protein should someone with gout consume? . since higher protein foods can trigger gout attacks how much protein is safe for someone with gout?','most helpful answer instead of thinking putting a cap on protein your better off balancing the type of protein foods in your diet. here are some tips: don\'t exceed 6 ounces of animal protein like chicken fish beef lamb or pork daily. 3 ounces is the size of a deck of card. you can get additional protein from low fat dairy sources such as yogurt milk and low fat cheese. plant sources of protein like nuts and nut butters are good and healthy too. avoid certain type of meat like organ meats an fish such as anchovies herring scallops trout and tuna. a dietitian can help individualize information to your specific preferences and lifestyle. journal about your trigger out your trigger foods -- see this article.','http://answers.webmd.com/answers/5081863/how-much-protein-should-someone-with-gout-consume'),
 (23,'do ace inhibitors cause weight gain? . long term user of ace inhibitor and have gained a lot of weight. is there a connection.','weight gain is not a common side effect of ace inhibitors. i suggest you see a registered dietitian to help you figure out the source of your weight gain. see this article for more on ace inhibitors.','http://answers.webmd.com/answers/5081636/do-ace-inhibitors-cause-weight-gain'),
 (24,'fruit is big part of my diet but i\'m having issues with urge intontinence. what fruits won\'t irritate my bladder? . i recently saw a urologist for having severe issues with urge incontinence feeling like i had to go as frequently as every 10 minutes. he determined stress in my life was causing my muscle around my bladder to flex. i\'ve recently been put on anxiety and stress medication which seem to be helping with that but the urge incontinence is still pretty bad a lot of the time. i\'ve read a ton of fruits which are a huge part of my diet can cause bladder irritation. what fruits are best/safest to eat?','the most problematic fruits that irritate the bladder are citrus fruits like oranges grapefruit lemons and limes. fruits that aren\'t acidic like pears apples grapes and melon are better choices. for more on trigger food and drinks see this webmd article.','http://answers.webmd.com/answers/5082000/fruit-is-big-part-of-my-diet-but-im-having-issues-with-urge-intontinence-what-fruits-wont-irritate-my-bladder'),
 (25,'does acupuncture aid weight loss','some science reveals that certain types of acupuncture may aid weight loss. acupuncture works by targeting pressure points linked to appetite and hunger. that being said acupuncture treatment does not trump making changes to diet exercise and how one handles stress. research shows diet changes are most important for weight loss. see ear acupuncture holds promise for weight loss.','http://answers.webmd.com/answers/5074670/does-acupuncture-aid-weight-loss'),
 (26,'how can i prevent nose bleeds ana are they linked to a deficiency of vitamins?','there is no evidence that nose bleeds are linked to a deficiency in vitamins the only nutrition/lifestyle related contributor is high blood pressure and smoking. this article provides tips on prevention and potential causes.','http://answers.webmd.com/answers/5078606/how-can-i-prevent-nose-bleeds-ana-are-they-linked-to-a-deficiency-of-vitamins'),
 (27,'i eat 1 200-1 500 calories a day. is that enough? . i\'m 19 5\"3\' female and weigh 120. for the past at least five years of my life i\'ve been eating 1 200-1 500 calories which leaves me feeling satisfied energized and maintaining my weight. i\'ve been eating a very healthy vegan diet and have eaten pretty healthy my whole life. i feel like i\'m eating enough and i\'m maintaining my weight but our \"experts\" say i need to eat more. i feel like if i ate more i would just gain weight but i\'m at a healthy weight now. i exercise moderately.','calorie needs are individual and depend on age gender lean body mass and your level of activity. since you are not overweight i wonder why you count calories at all. it seems to me if you eat well balanced regular meals and let hunger and fullness guide your eating you will get the right amount for your body type. emerging research shows that young adults who eat this way (often called intuitive or mindful eating) have lower bmis -- and disordered eating -- then those who don\'t. it may be that you started counting calories to lose weight 5 years ago. but i say ditch the calorie counting and learn how to trust and nourish your body instead. read more. healthy eating: recognize your hunger signals hope your weight is 120 pounds and not 120 kg. if the current calorie intake keeps you satisfied and energized you do not have to worry at all. if you are following any diet chart see to it that your calorie intake is between 1800-2100 calories which is normally recommended for a healthy person.','http://answers.webmd.com/answers/5074453/i-eat-1200-1500-calories-a-day-is-that-enough'),
 (28,'what causes a large uterus?','there are a few reasons for why the uterus measures larger than the dates. the most common reason is you are further in the pregnancy then you think. but since you had an ultrasound exam this is not the case. another reason could be you are carrying more than one child like twins. but if you had an ultrasound exam they should have seen this (although this can be missed). uterine fibroids (benign muscle tumor) of the uterus can make the uterus larger then you think. the other thing it may be is your doctor is wrong. it is just an estimation. i would not be too concerned about it at this time. when you see your doctor ask him about what the ultrasound exam showed. you can also call the office and speak to someone to read you the ultrasound results. uterus larger than the dates:? = wrong date (lmp) =polyhydramnious (excess amount of amniotic fluid in uterus) =larger baby (macrosmia) =multiple pregnancy =molar pregnancy =uterine fibroids =pelvic mass uterus smaller than the dates.? =wrong date (lmp) =oligo hydramnious =smaller baby (microsmia) =head engaged too deeply =genetic (maternal paternal small size) =intrauterine growth restriciton (iugr) =intrauterine death (iud)','http://answers.webmd.com/answers/1189630/what-causes-a-large-uterus'),
 (29,'is eating fruit bad after meal?','no eating fruit is great because it\'s healthy and sweet. and most people don\'t get nearly enough fruits and vegetables i n their diet. fruit contains vitamins antioxidants and fiber. of course if you\'re not hungry or are full than eating more food -- even fruit -- is not beneficial.','http://answers.webmd.com/answers/5078920/is-eating-fruit-bad-after-meal'),
 (30,'very high metabolism! very skinny! need help gaining weight! . help! please! i have a very very high metabolism and its impossible for me to gain weight! i am 17 years old. im about 5ft 7\" and only weigh around 107 lbs. and its hard for me to consume loads of food because of school! (6am-3pm) so i need help! i need a plan for me because im so confused where to start. i also have this problem where i get full quick and get hungry quick. and if there\'s any pills i could take that could help me that\'d be great','early fullness could be a sign something else is going on so i recommend you get a physical and talk to a healthcare provider. i also recommend you see a registered dietitian for individualized advice. you can find a dietitian in your area by going to eatright. org. in the meantime here are some things you can do to get started: eat regular meals and snacks every day (5-6 times daily). try to plan your meals ahead of time and have items you can put together for quick meals. include 3-5 food groups at meals including a whole grain protein (meat/beans/nut butter) fruits vegetables full-fat dairy (whole milk/yogurt) and healthy fats. for example in the morning you might have a big bowl of oatmeal topped with fruit and nuts and a side boiled egg. lunch might be a big sandwich salad and soup. include 2-3 food groups at snack time which may consist of cheese and whole grain crackers or an apple with peanut butter or half a meat sandwich with veggie sticks. try to include at least one fat source at every meal: butter or nut butter on bread nuts on cereal salad dressing on greens etc. for more tips on how to gain weight in a healthy way see this article.','http://answers.webmd.com/answers/5074606/very-high-metabolism-very-skinny-need-help-gaining-weight'),
 (31,'how long after changing my diet should i expect to see a drop of my blood sugar scores? . just curious. have recently been diagnosed with type 2 and have changed my diet significantly. how long before a diet change would influence my numbers?','changes to your diet can have an immediate affect on your daily blood sugars. but as for as your hemoglobin a1c levels that takes about 3 months to see a difference. that is because the test measures blood sugar management over a 3 month period of time. if you keep your blood sugars down consistently your next test should decrease quite a bit. for more read glycohemoglobin (a1c)','http://answers.webmd.com/answers/5076140/how-long-after-changing-my-diet-should-i-expect-to-see-a-drop-of-my-blood-sugar-scores'),
 (32,'is adhd a chronic condition meaning medication will always be necessary? . an 11yr. old boy in my family has been taking medication for adhd for over 5 years. i\'m aware that a usual side effect of his medication is loss of appetite which he experiences. in a group of boys his age playing baseball he is one of the smallest boys. are there alternative medications/treatments that would improve his appetite and possibly allow him to reach a more normal height/weight? i\'m concerned this height/weight difference is beginning to cause or will cause self-image issues.','it\'s important for you to keep in contact with the doctor to check if medication is needed and the different types available. not all affect appetite the same way. also some may allow you to skip taking them on the weekends when not in school. again researching and working with your doctor is key. as far as nutrition goes a pediatric dietitian can help you maximize nutrition for your son even while he\'s on medication. she or he will help you troubleshoot fluctuations in appetite and how best to time food offerings. also what combination of food and supplements are beneficial. also your son may be smaller due to genetics so consider your family history too. more reading: adhd drugs and growth','http://answers.webmd.com/answers/5076502/is-adhd-a-chronic-condition-meaning-medication-will-always-be-necessary'),
 (33,'how whey protein might interacts with gluten intolerence. for the last few days i\'ve been awakening with extreme fatigue and an oppressive headache both of which can last all day and are the exact symptoms of my gluten intolerance. after double checking my regular diet they only thing if found that seem the slightest bit suspicious is whey protein which is contained in the chocolate frosting i used sometimes. thus my question. any thoughts? . thanks sam','first off i would call the company to be sure it is gluten free. if that\'s not it you may want to consider seeing a leap dietitian who can help you identify if there are other foods linked to your symptoms. often times someone with gluten intolerance will have difficulty with other foods. you can find a dietitian in your area by going to eatright. org. good luck!','http://answers.webmd.com/answers/5077562/how-whey-protein-might-interacts-with-gluten-intolerence'),
 (34,'i read an artical that said you can take more than 10 000iu of vitamin d3 for weight lose. is that true? health risks?','vitamin d is not given for weight loss but it is common for people with excess weight to have low vitamin d levels. a doctor may prescribe very high levels to bring levels back up. it is not recommended for someone to give themselves more than the tolerable upper limit of vitamin d (4 000iu) unless prescribed by a doctor. although toxicity is rare it can occur causing increased calcium levels in the blood. for more on vitamin d supplementation see this article.','http://answers.webmd.com/answers/5076641/i-read-an-artical-that-said-you-can-take-more-than-10000iu-of-vitamin-d3-for-weight-lose-is-that-true-health-risks'),
 (35,'is pure almond extract considered a food allergen? . i am a cake and cookie designer and i am creating allergen content labels for my vanilla almond cookies. i use pure almond extract. is this considered a food allergen?','yes it is. almond is a tree nut which is considered a food allergen.','http://answers.webmd.com/answers/5076920/is-pure-almond-extract-considered-a-food-allergen'),
 (36,'i am constantly fatigued. i\'ve had thyroid checked and take vitamins. i am 46. nothing seems to help. i get enough sleep. i don\'t know what the problem is. i get enough sleep i take my vitamins i get my thyroid checked on a regular basis. nothing helps.','from a nutrition standpoint you still could be low in certain nutrients even with taking vitamins. for example if you are low in vitamin d the amount in a multivitamin wouldn\'t be enough to raise your levels to normal. the best thing is to go to your doctor and get a full lab workup done. i would be interested in iron folate b12 potassium and vitamin d levels but they will check everything. see 10 possible reasons for being tired','http://answers.webmd.com/answers/5077104/i-am-constantly-fatiguedive-had-thyroid-checkedand-take-vitaminsi-am-46-nothing-seems-to-help-i-get-enough-sleep'),
 (37,'how to get rid of remaining stomach belly after loose weight. so i\'ve been fat for as long as i remember but about a year ago i lost a lot of weight after which i started working out everything is going fine but there still remains one problem - my stomach belly. so i\'m a little bit confused now. the rest of my body is looking for some weight gain while my stomach is still there and if i try to gain my weight my stomach will get even bigger while if i start a diet to loose my weight my muscles won\'t have a chance to develope. any ideas what to do?','there are a few things to consider. first is it possible that your belly is big from excess skin? if so maybe a visit to your doctor on options will help. there is no way to spot reduce or gain. but getting more fiber in your diet may help decrease belly fat as can getting enough sleep. this article has some additional tips too. maybe if you are now at a good healthy place you could not try to gain or lose and just keep your body in good shape and eat a healthy diet. a dietitian can help you with your individualized needs. you can find one in your area by going to eatright. org. good luck!','http://answers.webmd.com/answers/5078378/how-to-get-rid-of-remaining-stomach-belly-after-loose-weight'),
 (38,'what is chirothin for weight loss? is it safe? why is it only given by chiropractic doctors? please answer for me. i would love to try this diet as i have seen rapid weight loss on you tube. what are the ingredients in it.','after going on the site i see no research showing the product is effective for weight loss and it sounds like it has a variety of ingredients instead of one active component. it does provide this statement \"*these statements have not been evaluated by the food and drug administration. these products are not intended to diagnose treat cure or prevent any disease. \" the fda doesn\'t evaluate dietary supplements for safety and effectiveness like it does drugs. in short there is no way to tell it works or is safe unless there has been adequate research done. i suggest you contact the company about research and run it by your doctor. for more on weight loss supplements see this article. good luck!','http://answers.webmd.com/answers/5071315/what-is-chirothin-for-weight-loss-is-it-safe-why-is-it-only-given-by-chiropractic-doctors-please-answer-for-me'),
 (39,'what vitamins help migraines?','webmd has a list of vitamins and other supplements that might help with headaches. the page lists the supplements weight of the evidence and reviews. the link is below. vitamins and supplements for migraines. vitamin supplements are advised in migraines for its prevention. vitamins like vitamin b6 b12 vitamin c folic acid are proven useful to reduce the severity and frequency of migraine attacks. these supplements also prevent the migraine attacks and improves overall the quality of life.','http://answers.webmd.com/answers/5071624/what-vitamins-help-migraines'),
 (40,'which whole foods naturally contain sodium?','as you are probably aware there are many foods that have salt added as a preservative and for taste. some foods that naturally contain sodium before processing include the following (nutrition info was taken from usda database): 1 cup of milk (127mg) or plain yogurt (113mg) and 1 egg (62mg). most veggies contain minimal sodium except a large stock of celery (51mg) and a medium artichoke (120mg). shellfish like shirimp (3oz about 100mg) and certain meats liike ground beef (3oz about 50mg) also contain sodium. sodium occurs naturally in many foods and is also added in the form of salt or other sodium-containing substances. some foods that naturally contains sodium are egg meat raisin cinnamon carrot celery broccoli cauliflower tomatoes and coconut milk to name a few.','http://answers.webmd.com/answers/5071525/which-whole-foods-naturally-contain-sodium'),
 (41,'what are the best weight loss techniques and programs for vegetarians? . i would like to maintain a good weight with proper diet and i have pretty sedentary life style and i am a vegetarian - so need some techniques to have a proper weight and balanced diet.','whether you are vegetarian or not the principles of weight management are the same: finding out the root causes of excess weight gain. first look at how you are eating? are you mindless about meals eating in front of the tv or grazing all day while doing other things. its best to pay attention and eat meals in a designated place. try to listen to cues of hunger and fullness. second is the type of food you are eating. if you allow dairy foods do you consume lots of cheese that is high in fat and calories? is your diet full of nutrient dense vegetarian foods like vegetables? do you eat sweets in moderation? balancing your food intake will help. lastly is activity. it sounds like you aren\'t doing much so finding ways to gradually increase your activity will help. for specialized help see a dietitian in your area. you can find one at eatright. org. here are some articles that can help: how to stop overeating how to lose weight safely vegetarian diet may help with weight loss good luck!','http://answers.webmd.com/answers/5072834/what-are-the-best-weight-loss-techniques-and-programs-for-vegetarians'),
 (42,'what vitamins are present in fish oil? carrots are carrots but they contain vitamins as well. what\'s in fish oil?','the reason people take fish oil is for the type of fat it provides: omega-3 fatty acids (dha and epa). most people do not get enough of these fats through diet unless they consume 2 servings of fatty fish such as salmon or tuna per week. these type of fats are important for brain development in babies cardiovascular health and they play a role in brain related conditions such as adhd and dementia. see this article for more information on fish oil.','http://answers.webmd.com/answers/5071468/what-vitamins-are-present-in-fish-oil-carrots-are-carrots-but-they-contain-vitamins-as-well-whats-in-fish-oil'),
 (43,'how can you prevent loose skin during weight loss?','although losing weight especially large amounts of weight is likely to produce loose skin here are some things that might help: lose weight at a steady rate versus rapid weight loss (for those losing through weight loss surgery this can\'t always be helped). get adequate nutrition including key vitamins and minerals. most people on low calories diets benefit from taking a multivitamin. include exercise and strength training as a part of your weight loss plan.','http://answers.webmd.com/answers/5071365/how-can-you-prevent-loose-skin-during-weight-loss'),
 (44,'does caffeine and salt cause vertigo and will eliminating it help it go away','dietary factors such as salt and caffeine are not causes of vertigo but they could be triggers or make it worse especially if the vertigo is caused by a migraine. i suggest finding out the cause of the vertigo and going from there. more reading: causes of vertigo lightheadedness and vertigo: topic overview caffeine and salt intake does not cause vertigo. in some people it may act as trigger factors. one must check for the causative factor for vertigo and get proper healthcare advise from physician.','http://answers.webmd.com/answers/5072887/does-caffeine-and-salt-cause-vertigo-and-will-eliminating-it-help-it-go-away'),
 (45,'why am i always hungry and tired? . i am a 19 year old male 6\'0\" tall 150 pounds. i work out at least 4 times a week including cardio and weight training. i eat healthy and balanced with the occasional junk food. i don\'t drink caffeine or soda. i always eat breakfast lunch and dinner and snack throughout the whole day. some days i eat over 3500 calories. i don\'t gain or lose weight easily. i sleep between 8-10 hours every night including the weekends. however i am constantly hungry even after a meal and i am always tired.','there could be a few things going on. even though you eat healthy you could be low in nutrients causing you to feel tired. the only way to know for sure is to go for a physical and get labs run including vitamin d glucose and iron. also less likely increased hunger accompanied with thirst and weight loss could be sign of diabetes. also look closely at the quality of your diet. are you eating filling foods with meals including healthy fats (nuts and seeds/avocado/veg oils) whole grains lean proteins dairy beans/legumes and fruits and veggies? the fiber found in plant foods such as fruits vegetables whole grains and beans help fill you up. fat provides adequate calories and is satisfying and protein is also filling. make sure your meals contain 4-5 food groups and snacks 2-3. you want to avoid grazing on less filling snacks high in refined grains and low in nutrients (crackers pretzels chips). if you need help see a registered dietitian. you can find one in your area at eatright. org. read more. filling foods do you feel hungry and tired on days when you eat more than 3500 calories? probably there is mismatch between calorie intake and expenditure. feeling hungry is ok with your workout schedule but feeling tired is worrisome. any family history of diabetes please check. there are a few reasons you are feeling tired without any reason. one of them is anemia which is a lack of red blood cells and conversely oxygen from the lungs is not properly brought to the tissues and cells. anemia may be caused by deficiency of vitamins or minerals internal bleeding or chronic diseases. women who are at “that time” of the month are susceptible to anemia as blood is lost during menstruation. still iron deficiency due to menstruation is less than in pregnant women or lactating mothers as their body needs extra iron to maintain healthy blood levels. things may also go wrong when your thyroid glands refuse to cooperate with you. thyroid hormones thyroxine (t4) and triiodothyronine (t3) are responsible for metabolic processes in the body. too much thyroid hormone causes hyperthyroidism which speeds up metabolism while too little thyroid hormone slows down metabolism. hyperthyroidism causes fatigue and muscle weakness and starts in the thighs. doing energy demanding activities become difficult and other symptoms include weight loss feeling warm shorter menstruations increased heart rate and thirst. hypothyroidism also causes fatigue and muscle weakness. the symptoms are reversed to hyperthyroidism such as weight gain feeling cold and longer menstruations. diabetes notorious for causing a range of problems in the body is also related to fatigue. as glucose is the staple fuel of the body it is not utilized properly in patients with type 2 diabetes as the absence of insulin causes the glucose to build up in the body. without its staple fuel the tissues of the body are not nourished properly and causes fatigue. sadly being sad can also be the reason you feel tired. depression induces negative feelings and also has negative effects on the body as it causes a reduction in energy levels changes in sleep and eating patterns decreased concentration and overall laziness and worthlessness which keeps you in bed all day. reference: <link>','http://answers.webmd.com/answers/5073080/why-am-i-always-hungry-and-tired'),
 (46,'is an anti-inflammatory diet including gluten free good for rosacea? . would an anti-inflammatory diet including gluten free foods','i\'m sure it can only help to eat healthfully but i don\'t know of research showing that anti-inflammatory foods have an impact on rosacea. gluten only causes inflammation if one has celiac disease an intolerance to gluten or an allergy to wheat. if you are thinking of removing gluten from the diet a registered dietitian can help guide you. there are certain foods that might trigger rosacea including hot foods spicy foods and alcohol. for more on triggers see this webmd article. best of luck to you!','http://answers.webmd.com/answers/5073133/is-an-anti-inflammatory-diet-including-gluten-free-good-for-rosacea'),
 (47,'i have been ill for a while and lost quite a bit of muscle and weight suggestions on getting it back and why i hurt? . so i have a thyroid disorder and i had it tested a month ago and still no answer back from anyone. i am feeling a bit better now but i can\'t seem to gain back the weight or the muscle. specifically on my legs and they hurt quite frequently. my legs were the strongest part before i got sick and they still are pretty strong but i\'ve never had leg pain when i ran or carried things before. and it worries me how thin they are now along with the pain. should i be concerned? suggestions?','be sure to get in touch with your doctor about your leg pain and thyroid -- only a healthcare provider can address your medical needs. once you get that worked out you can focus on gaining muscle. make sure you get protein at every meal along with a balanced diet adequate in calories. research shows 25 grams or more of protein at meals helps build muscle. to give you an idea 1 ounce of lean meat has 7 grams. also exercise that includes resistance training is beneficial as long as it\'s okay with your doctor. after working out consume a snack that contains protein and carbohydrates within a half hour of stopping exercise. more reading. healthy protein sources what to eat before during and after exercise','http://answers.webmd.com/answers/5073530/i-have-been-ill-for-a-while-and-lost-quite-a-bit-of-muscle-and-weight-suggestions-on-getting-it-back-and-why-i-hurt'),
 (48,'on nurtisystem for 35 days lost 20 pounds a1c from 6. 0 to 8. 1. . after being on the nutrisystem diabetic program for men for 35 days and losing a total of 20 pounds my a1c went from 6. 0 to 8. 1. i am 5\' 7\" and a current weight of 177. 2 pounds? why would my a1c increase? was it due to the previous 3 months?','there could be a few things going on. did you change or alter your medication (if you are on medication)? also as you say a1c is an average over 3 months so how you were eating the two months prior makes a difference it\'s also possible your carbohydrate intake was lower before starting the diet and the increases changed your blood sugar. i would see a diabetes educator while you work at getting to the right weight for you. they can help guide you in the process. good luck!','http://answers.webmd.com/answers/5073245/on-nurtisystem-for-35-days-lost-20-pounds-a1c-from-60-to-81'),
 (49,'can vitamin overload cause muscle cramping? ( ribs legs feet hands)','muscle cramps can occur from low levels of minerals in the blood such as potassium but i have not heard of it being caused by an excess of vitamins. there really is no reason to take large amounts of vitamins so it makes sense to stop or just take the recommended daily allowance. if the cramping continues see your doctor to determine cause. this article provides various reasons for muscle cramping. usually muscle cramps do not occur due to excess of vitamins. although muscle weakness is one of the symptoms of hypervitaminosis e. however anything excess in the body causes imbalance and can lead to untoward effects.','http://answers.webmd.com/answers/5073495/can-vitamin-overload-cause-muscle-cramping-ribs-legs-feet-hands'),
 (50,'i have a son who is 10 years old and 5 ft tall and he is on adhd medicene but cannot gain weight he is only 67 lbs. right now i know it probably has to do with the adhd med but he cannot go off it is their a protein diet he go on so it will not hurt him?','protein diets do not cause weight gain and may even cause weight loss. most important is following your son\'s appetite. kids on adhd meds tend to be hungriest in the morning and dinnertime when the effects of mediation have worn off -- take advantage of these times. your best bet is to see a pediatric dietitian. they will track your son\'s growth and can provide diet recommendations to keep his weight and growth on track. they understand the effects of different medications. don\'t delay getting help! see adhd drugs and growth','http://answers.webmd.com/answers/5078450/i-have-a-son-who-is-10-years-old-and-5-ft-tall-and-he-is-on-adhd-medicene-but-cannot-gain-weight-he-is-only-67-lbs'),
 (51,'what fruit are okay for inflammed stomach. my stomach is inflamed and i like to know if any what fruit are okay to eat? i should be on a bland diet.','you want to stay away from fruits more likely to irritate your stomach such as those with tough skins or seeds. check with your doctor to see how long you diet needs to be limited. these fruits may be better tolerated:: bananas soft cantaloupe honeydew fruits that are canned or cooked without seeds and skin -- applesauce fruit cocktail or canned pears avocado','http://answers.webmd.com/answers/5068227/what-fruit-are-okay-for-inflammed-stomach'),
 (52,'if a mother says to her 12 year old girl \"i love u more if u were skinny\" will it mentally scar the child? . will the child also develop abnormal behavior and think abnormally. i have a friend who is always depressed and she asked me why i would hang out with her. i said becuz u are nice and clean and a good person and u love god. she didn\'t believe me saying that she was too fat for that and explained to me that her mom didn\'t love her becuz she said \"i love u more if u were skinny\". she said she thinks her mom doesn\'t care if she was rude or disrespectful as long as she is skinny. .','if a parents send their kids the message that they value appearance more than who they are as a person it will not have beneficial effects. that being said every person is different in how they react to such circumstances so it\'s hard to generalize. this article discusses the connection between weight and mothers and daughters. maybe your friend can get help with this issue so she can see how it is affecting her life today.','http://answers.webmd.com/answers/5069337/if-a-mother-says-to-her-12-year-old-girl-i-love-u-more-if-u-were-skinny-will-it-mentally-scar-the-child'),
 (53,'i had open heart surgery five bypasses i need to lose weight and start a diet and excise program where can i fine one? . i\'m over weight and been fighting this for awhile i','i would start by looking for a program where you got your surgery. most hospitals offer cardiac rehab classes for new patients where they have dietitians and physical therapists counsel and provide advice. it\'s important to get this specialized help because of your cardiac history. i would start there or with your doctor as they might have a program they recommend for their patients. be sure not to try any fad diets. see this article for more about cardiac rehab.','http://answers.webmd.com/answers/5069402/i-had-open-heart-surgery-five-bypasses-i-need-to-lose-weight-and-start-a-diet-and-excise-program-where-can-i-fine-one'),
 (54,'what is more important for a newly diagnosed diabetics? change diet or stop smoking?','i would say whichever you feel you can do most successfully. smoking is a huge health risk factor and can affect blood sugar levels. if you choose to do that first which makes a lot of sense you can still make small changes to your diet while taking medication. for example eating at the right times to coincide with medication and checking blood sugar can be a good first step while you kick the smoking habit. once your smoking habit is under control you can dive deeper into diet and exercise. but the key is starting somewhere and taking it one small step at a time. good luck! see more. smoking cessation health center a healthy type 2 diabetes diet','http://answers.webmd.com/answers/5069536/what-is-more-important-for-a-newly-diagnosed-diabetics-change-diet-or-stop-smoking'),
 (55,'what are the healthy foods i should be eating when trying to lose weight? what foods help with weight loss? . i\'ll be 30 in a few weeks and weigh 185 lbs.','it really isn\'t just about what foods to eat but how you regulate your food intake. foods low in calories but high in nutrition can help such as fruits vegetables low fat dairy whole grains and lean meats. but if you skip meals or don\'t pay attention while eating you can end up eating too much or too little. so i usually start by recommending people start with how they eat -- structure regular meals stay at the table when eating and stop when getting full. then add in healthy foods into those meals. for more on what and how to eat see these articles: eat healthy to lose weight how to practice mindful eating','http://answers.webmd.com/answers/5069712/what-are-the-healthy-foods-i-should-be-eating-when-trying-to-lose-weight-what-foods-help-with-weight-loss'),
 (56,'what is the best diet for hypoglycemia and weight loss?','i highly recommend you see a registered dietitian to help you develop a meal plan -- and guidelines -- for weight loss. you can find one at eatright. org or through your doctor. in terms of diet people with hypoglycemia need the following: eat small frequent meals limit added sugars such as those in beverages and desserts include a source of protein with meals/snacks eat a balanced diet with all the food groups (so carbohydrate protein and fat is balanced) limit caffeine and alcohol increase fiber eat appropriately before and after exercise read more about hypoglycemia here.','http://answers.webmd.com/answers/5073020/what-is-the-best-diet-for-hypoglycemia-and-weight-loss'),
 (57,'can babies drink silk soy milk?','babies 12 months and younger should not drink soy or cows milk they need the nutrition from either breast milk or formula. after one year it is okay to introduce cows milk. if there is a milk allergy or intolerance fortified soy milk is a fine alternative. be sure to stick with full fat sources until baby is two due to high growth. and be sure the milk you choose is fortified with calcium and vitamin d.','http://answers.webmd.com/answers/5069621/can-babies-drink-silk-soy-milk'),
 (58,'you asked: my son is 6 year old he don\'t like to eat those food which taste sweet is there any disorder in his taste bud','i think it depends on his eating overall. if he eats a variety of food but just doesn\'t like food really sweet that may simply reflect his personal preferences. but if he eats very few foods it could indicate a sensory issue or that he is super taster (not serious -- just more sensitive to the tastes in food). if you feel his nutrition and growth is affected see his pediatrician for a referral to a feeding therapist who can help you figure out what is going on. good luck!','http://answers.webmd.com/answers/5069698/you-asked-my-son-is-6-year-old-he-dont-like-to-eat-those-food-which-taste-sweet-is-there-any-disorder-in-his-taste-bud'),
 (59,'not loosing weight exercise brutally and consistently! due to a recent stressful situation i became partially bald! . i am a 27 year old male with no prior medical illnesses other than allergies and colds. i exercise frequently and more than many people i know who are fit. i have been tracking my workouts for the past 2 years and have followed a million diets. i always try to make the healthier choice when i go out to eat (not often) and drink on occasion. from august 2014 - december 2014 i ran boxed lifted weights in combination and lost little to no weight. bp is 9<negative_smiley>72 and after exercise 115/90ish','you don\'t mention how much weight you have to lose. if you don\'t carry that much weight you might be at the place your body wants to be. your blood pressure is good but how about other health indicators like cholesterol? if you weight is too high you need to closely look at how much and what you are eating. do you eat mindfully by sitting down to meals and stopping when comfortably full? do you skip meals? how is your diet quality? research shows that exercise doesn\'t aid weight loss as much as diet. another factor is stress as you mention which can affect appetite. getting a handle on stress management can go a long way. here is more reading that can help: do you really need to lose weight? why can\'t i lose weight? hi for me if you was doing everything you say then you would be losing weight. but your not so your cheating its the only answer you need to as strict with what your doing as you say above do that and you will lose weight. but get on to some of these new ways of losing weight like the caveman. get out walking but brisk walking take a weighted back pack and when doing that find some hills to climb get up early go swimming these last two are some of the best ways to lose weight you just keep away from fast foods and junk foods and no sodas drink lots of water. all ways think of these self discipline. self control. breaking bad habits. in grain these in your mind. good luck','http://answers.webmd.com/answers/5070216/not-loosing-weight-exercise-brutally-and-consistently-due-to-a-recent-stressful-situation-i-became-partially-bald'),
 (60,'what should be the exact calories we should have in one day? . i put on my weight 10 kg in last 6 months but my confusion is that i have not taken any heavy food then why i gained my weight. . please suggest me what had happened with me and how i can loose my weight?','first off if you feel that your eating and activity has not changed along with this weight gain a visit to your doctor is in order. he or she can make sure anything else isn\'t going on. there could be less obvious reasons for weight gain such as decreased activity medications more drinking of alcoholic beverages and stress. this article can help identify hidden sources of weight gain. there is not a set calorie level for each person as each of us has different metabolisms. that being said you can reference this chart to give you an idea. with some time and investigation you can get to the bottom of the weight gain. good luck!','http://answers.webmd.com/answers/5070747/what-should-be-the-exact-calories-we-should-have-in-one-day-'),
 (61,'what health consequences will i face because of my meal plan for my eating disorder and the desserts that i eat nightly? . i am currently recovering from an eating disorder and have to follow a meal plan. sadly this requires me to eat dessert every night. i have been doing so since about mid-february. i am a fitness and nutrition fanatic (this did not help in developing an) and i have a major fear of suffering health consequences due to the fact that i am forced to eat sugary desserts every night. is there any health repercussions? what should i do?','most helpful answer the important thing is that you understand why the dessert is in your meal plan. talking with your therapist is key because he or she is likely doing it to help change your relationship with food. the tendency with eating disorders/disordered eating is people give too much power to a single food instead of looking at the overall pattern of eating. as for your health no eating a sweet food everyday will not ruin your health (i do it! ) especially when your diet is balanced. it\'s the extremes that are harmful -- eating sweets/chips/empty calorie foods all day long or eliminating so many foods/items that it\'s hard to maintain a healthy weight and enjoy eating. i hope that helps. good luck on your journey!','http://answers.webmd.com/answers/5078476/what-health-consequences-will-i-face-because-of-my-meal-plan-for-my-eating-disorder-and-the-desserts-that-i-eat-nightly'),
 (62,'i\'ve had almost no appetite for several months and am losing an unhealthy amount of weight. how to reverse both losses? . i\'ve had no appetite for maybe three or four months. i have a history of anorexia but this is unintentional. i buy cook and order food i want to eat but the second it\'s in front of me i can\'t eat it. i recently moved took a less stressful job and am at a lower level of anxiety than i\'ve ever been before but my jaw clenching is coming back and i can\'t make myself eat. i\'ve lost a lot of weight and my starting point was already pretty thin. i\'m five foot two inches and weigh around 90 lbs','because of your history of anorexia its best to see someone who specializes in eating disorders to rule out relapse. even if you feel this is not the case doing so is in your best interest. if that leaves you with no answers you can get a physical to check the potential medical reasons for decreased appetite. for now when you do have an appetite take advantage of it. if breakfast is when you are the most hungry eat a full big breakfast. notice times your appetite changes and follow along. consider adding frequent meals throughout the day. meditation and mindfulness also can help. take care of yourself. anorexia with unintentional weight loss should not be ignored. this can be due to some severe ailment/condition. better visit your physician and get yourself checked up.','http://answers.webmd.com/answers/5078619/ive-had-almost-no-appetite-for-several-months-and-am-losing-an-unhealthy-amount-of-weight-how-to-reverse-both-losses'),
 (63,'is bone structure ever taken into account with bmi? . i have extremely dense/large bone structure. i am never healthy at the weights the charts say i should be at. i do not have a typical women\'s structure. i feel the bmi charts are set for a petite woman and not for me.','bmi takes into account mass (weight) and height. mass includes muscle fat and bone. so if someone has large bones or more muscle than fat this will not be taken into account. this is the key limitation of bmi. it is used a screening tool but should not be used as an indicator of health status. for more on bmi see how accurate is body mass index?','http://answers.webmd.com/answers/5082465/is-bone-structure-ever-taken-into-account-with-bmi');
INSERT INTO `dataset` (`Id`,`Question`,`Answer`,`URL`) VALUES 
 (64,'what foods will increase albumin? . my husband\'s albumin level is 2. 4 and the low level is preventing him from participating in a clinical trial for lung cancer.','a low albumin can be caused by a variety of factors including nutrition medications and fluid status. talk to his doctor about how much fluid your husband needs and potential contributors to his low albumin. as long as he has no diet restrictions getting adequate protein can help. protein sources include eggs chicken fish meat cheese/milk nuts/nut butters and beans. aim for at least one protein source at each meal and with snacks. make sure his diet is balanced with other foods to balance out his diet. sample day: b-fast: omelet with veggies and toast snack: greek yogurt topped with nuts and fruit lunch: turkey chili with side of fruit and bread snack: smoothie with added protein powder dinner: fish whole grain & veggies','http://answers.webmd.com/answers/5082067/what-foods-will-increase-albumin'),
 (65,'i\'d like to know what the best combination of supplements are for a vegan including enzymes amino acids and vitamins. i\'ve been looking into collagen (to improve bone density skin and hair) spirulina (for protein and immune function) maca powder(hormonal function and fertility) omega3 6 9 and digestive enzymes (to help with bloating and stomach problems). i also take a multi vitamin. i am overwhelmed with the wealth of information and would like advice on the best combination as i don\'t want to take too many supplements when i don\'t fully understand how they might effect each other. thanks in advance.','i\'m not familiar with the supplements you are taking. you can look here for more info. my guess is there isn\'t a lot of evidence to support them. i can help you from a nutrition standpoint though. if you are a vegan and eat a balanced diet you still need to watch out for the following nutrients: calcium: this article will help you figure out if you are getting enough. plant foods and fortified milk alternatives can get you there but you need to be diligent. you can always supplement if you fall short. iron: beans and grains contain iron but they aren\'t absorbed as well as animal foods. this article can help you ensure you get enough. vitamin b12: plant foods do not contain vitamin b12 so you will can include fortified foods or take a supplement. vitamin d: this vitamin is not in plant foods unless its fortified. you will likely need to supplement. i recommend getting your levels checked at annual physical to determine how much you need. omega 3s dha and epa: plant foods do not contain these important fats -- there are vegan supplements you can look into. if you are still confused consider seeing a registered dietitian. he/she can help you figure out what supplements you need and what you can just get from food good luck!','http://answers.webmd.com/answers/5082136/id-like-to-know-what-the-best-combination-of-supplements-are-for-a-vegan-including-enzymes-amino-acids-and-vitamins'),
 (66,'is it ok to have lemon in water before a fasting blood test?','while there is not much sugar in lemons you should only drink water before your fasting blood sugar. try scheduling the test first thing in the morning.','http://answers.webmd.com/answers/5084347/is-it-ok-to-have-lemon-in-water-before-a-fasting-blood-test'),
 (67,'how do i get back on track after being on various crash diets for months and then eating unhealthy for the last 2 weeks? . just wanted to note that i am at a healthy weight (bmi 20. 6) and i have been craving unhealthy foods at every meal. i feel like i\'m \"out of control \" since i had gotten down to a bmi of 19. 6 for a special event. what\'s a good way to get back on track and stop gaining weight?','i think it\'s important for you to take step back. you are not even close to being overweight and although you say your weight is healthy that doesn\'t mean that your body is healthy. bmi categorizes weight not health. restrained eating which is always depriving yourself by dieting or restricting food put all the focus on forbidden foods hence the out-of-control feelings. this is also called the diet-binge-diet cycle. some find a way to keep their weight down but others gain weight overtime (studies show dieting is linked to weight gain over time not weight loss). regardless of weight research shows that this type of eating style negatively effects life satisfaction and self esteem. i\'ve been there and constantly thinking about food takes energy away from all the other important aspects of life. there is another way of eating that will make you happier healthier and keep your weight stable. instead of focusing on weight and what foods to eat or not eat focus on health and feeling good. listen to your body and feed it a variety of food. instead of stopping because the portion is done listen and honor feelings of hunger and fullness. research shows people are healthier and happier when they eat this way. now this might be hard for you to do so i suggest getting help from a professional like a registered dietitian. you can find one at eatright. org. also you can read the following articles: how to become an intuitive eater the 7 habits of highly effective eaters improving body image best of health to you!','http://answers.webmd.com/answers/5084557/how-do-i-get-back-on-track-after-being-on-various-crash-diets-for-months-and-then-eating-unhealthy-for-the-last-2-weeks'),
 (68,'will drinking herbal tea negatively affect my taking iron pills? . will drinking herbal tea negatively affect my taking iron pills?','most helpful answer black green and oolong tea contain tannins that bind to iron and decrease its absorption. herbal teas can have tannins too but it varies from tea to tea (darker teas have more). to play it safe do not drink tea right after or before taking your iron pill. for example if you have tea in the morning stop a couple hours before lunch and take your pill after eating or wait until the afternoon.','http://answers.webmd.com/answers/5084444/will-drinking-herbal-tea-negatively-affect-my-taking-iron-pills'),
 (69,'vit d 25-hydroxy test yesterday my level is 5 what will i have to do in order to get my levels to normal?','you need to call your doctor. he or she should prescribe a vitamin d supplement to get your levels back up and will test you again to be sure it\'s working. once your levels are normal your doctor will recommend a maintenance dose to keep your levels above normal. for more on the subject see this article about vitamin d deficiency. don\'t delay!','http://answers.webmd.com/answers/5084428/vit-d-25-hydroxy-test-yesterday-my-level-is-5-what-will-i-have-to-do-in-order-to-get-my-levels-to-normal'),
 (70,'why do some vitamins contain too much zinc. preservision areds has 348 mg. and the max. daily is 40 mg. ! why would they put that much in there. now i\'m afraid to take it paid for it and opened it can\'t return it.','you should call the manufacturer and ask the company why. supplement companies are not regulated like drugs are so be careful and make sure your voice is heard. zinc intakes above 150 mg have been associated with adverse effects such as low copper status and a lowered immune response. no more than 40mg in supplements is recommended. read this for more on zinc supplementation.','http://answers.webmd.com/answers/5086989/why-do-some-vitamins-contain-too-much-zinc'),
 (71,'could minor surgery cause signs of multiple sclerosis exacerbation such as clumsiness dizziness and muscle spasms?','people will frequently relate onset of symptoms to certain life events (surgery car accident etc). it is not clear if there is cause and effect but we know that stress can affect the immune system. there is also some work to suggest that ms patients may have exacerbations more frequently when under stress than not. so call your neurologist and discuss what is happening. david','http://answers.webmd.com/answers/1190576/could-minor-surgery-cause-signs-of'),
 (72,'i am a 64 year old active femal wth osteopenia i take 35 mg of risedronate weekly. how much calcium and d do i need? . please give daily total of what i should ensure i get in both food and supplements.','it\'s important you talk to your healthcare provider about the amounts they recommend. vitamin d recommendations are usually based on your blood levels. if they are low doctors often recommend high doses until levels reach acceptable. they also might have recommendations for calcium based on your medication and diagnosis. that being said the recommended amount based on your age and gender is 1200mg calcium and 600iu vitamin d. this calcium calculator can help you determine how much is in food and this article can help you with vitamin d. once you determine how much you get with food you can consider supplementation. just be sure to check with your doctor.','http://answers.webmd.com/answers/5086951/i-am-a-64-year-old-active-femal-wth-osteopenia-i-take-35-mg-of-risedronate-weekly-how-much-calcium-and-d-do-i-need'),
 (73,'can hot weather affect multiple sclerosis?','heat does cause a \"pseudo exacerbation\" and many multiple sclerosis patients are sensitive to heat. these changes are called \"pseudo exacerbations\" because the changes that occur are reflect changes in physiology and not damage caused by the immune system. the myelin that covers nerves is there to make electrical impulses travel very quickly. these electrical impulses travel most efficiently at normal body temperature. as you increase the temperature the impulses slow down. in normal myelin this is not a problem but in areas of the nervous system damaged by ms the impulse will slow enough to bring out symptoms. there is no damage to the nervous system. when this happens you need to cool down to improve the symptoms. if you are heat sensitive and have ms you need to protect yourself from getting overheated.','http://answers.webmd.com/answers/1190578/can-hot-weather-affect-multiple-sclerosis'),
 (74,'can using prednisone hide positive results from multiple sclerosis testing?','steroids may reduce inflammation and can reduce the number of enhancing lesions (lesions that turn bright white on mri after getting the injection of contrast dye)on mri. but it will not make lesions disappear and should not stop someone form making the diagnosis of multiple sclerosis.','http://answers.webmd.com/answers/1190575/can-using-prednisone-hide-positive-results'),
 (75,'can i take zotex while on cipro?','this is a great question and very common for pharmacists to get during cough cold and allergy season. it is fine to take these two medications together. if you ever have any questions about possible drug interactions or other questions come and ask the pharmacist. we are here to help.','http://answers.webmd.com/answers/1182573/can-i-take-zotex-while-on'),
 (76,'can you take tylenol and benadryl together?','this is a great question to ask you pharmacist. yes it is fine to take these medications but make sure you tell your doctor or health care provider along with your pharmacist and add them to your personal medication list. make sure you follow the instructions on the package for each and be aware of the possible side effects like drowsiness dizziness and dry mouth. if you have any questions just ask!','http://answers.webmd.com/answers/1182572/can-you-take-tylenol-and-benadryl'),
 (77,'why are some medications like sudafed kept behind the counter?','sudafed is an over-the-counter (otc) nasal and sinus decongestant that contains the active ingredient pseudoephedrine. although safe and effective if used as directed it has been placed behind the counter because of its potential for misuse and abuse. federal regulations require states track products containing pseudoephedrine as a means to curb improper use.','http://answers.webmd.com/answers/1182570/why-are-some-medications-like-sudafed'),
 (78,'how does naturaly produce cholesterol of the body differ from cholesterol in dietary foods?','cholesterol in the body is a waxy like substance that travels through blood and provides many important functions like making hormones. no one needs to ingest cholesterol because the body makes it especially the liver. the process of making \"bad cholesterol\" (ldl) increases when someone eats too much saturated and trans fat and not enough fruits vegetables and soluble fiber. the good cholesterol (hdl) is beneficial for health because it helps clear the bad cholesterol out and is related to exercise and the consumption of healthy fats (nuts vegetable oils etc) intake. there is also a genetic link to cholesterol levels meaning people with a family history of high cholesterol may be at higher risk. cholesterol is also found in foods of animal origin such as meat poultry and full fat dairy but isn\'t linked to high cholesterol as much as saturated and trans fats are. that being said the american heart association says too much cholesterol in the diet can lead to increased plaque in the arteries. for more info see the basics of cholesterol','http://answers.webmd.com/answers/5062958/how-does-naturaly-produce-cholesterol-of-the-body-differ-from-cholesterol-in-dietary-foods'),
 (79,'gastic bypass help. can you shrink your stomach back after stretching it out? . ive had gastric bypass a few years ago. i\'ve done extremely well with it. but this year i\'ve struggled a lot with excerise and eating healthy. some things were out of my control and some things were in my control as far as staying on track. . my concern is i have gained almost 30 lbs back in the last 18months. if my stomach stretched out do to this weight gain csn it be reshrunk? . my goal is to get back on track asap. what can i do to make my stomach shrink back down.','it is difficult to stretch out your stomach after gastric bypass. it may happen somewhat with constant overeating over a long period of time but i wouldn\'t worry about it now. you still have your tool of a smaller stomach but you need more than just that. the most important thing is to seek help and support from you doctor and support staff such as the dietitian. the hardest part is dealing with life\'s ups and downs after you have lost weight. learning new coping skills positive ways to deal with stress and ways to keep your diet on track is key. support is what you need so you can be ready the next time you struggle.','http://answers.webmd.com/answers/5086416/gastic-bypass-help-can-you-shrink-your-stomach-back-after-stretching-it-out'),
 (80,'what can be done about headaches associated with multiple sclerosis?','headaches are usually not a feature of multiple sclerosis. however headaches are a common problem and many ms patients have migraine headaches along with their ms. the headaches need to be treated since the constant pain can be very demoralizing and make life more difficult. your son\'s neurologist should be able to work with him to find a medication that helps his headache pain. you may want to ask your neurologist about midrin and topamax. both of these drugs have seemed to help me in the past. i have also tried botox injections - alot of injections around eyes neck scalp as well as my mouth as i twitch there off and on. have tried botox injections twice now and find them only mildly effective.','http://answers.webmd.com/answers/1190577/what-can-be-done-about-headaches'),
 (81,'are there any specific supplements or vitamins needed to be taken for a pescatarian diet?','it depends on the quality of your current diet. some pescatarians eat dairy and others don\'t. if you don\'t eat dairy vitamin d and calcium are of concern. even if you do eat dairy it is likely you need vitamin d unless you are having fatty fish every day. you don\'t have to worry about omega-3 (dha and epa) if you are having fatty fish twice a week. you need to be sure you are getting enough iron and zinc but with careful planning it shouldn\'t be a problem. in short a well-balanced pescatarian diet can supply most of the nutrients you need (except d which is low in food). this article can help you make the right choices. of course you can always take a multivitamin if you feel you diet is inadequate.','http://answers.webmd.com/answers/5087219/are-there-any-specific-supplements-or-vitamins-needed-to-be-taken-for-a-pescatarian-diet'),
 (82,'what vitamins could you take for low estrogen?','although supplement companies will claim their vitamins will help balance hormones the evidence regarding this is lacking. first off a lot depends on why your estrogen is low. if it is because of peri-menopause or menopause you want to be sure you are getting enough calcium (through diet is recommended over supplements) and vitamin d for bone health which can decrease with lower levels of estrogen. look at your diet. try to eat healthier by including plenty of fruits vegetables whole grains low fat dairy healthy fats and lean protein (including fish twice a week). if there are gaps in your diet then consider supplementing. for example if you don\'t eat fish you may want to consider omega-3 fatty acids (fish oil). vitamin d is tough to get through food so supplementation is usually needed. if you are concerned about it see a registered dietitian who can help you sort through the proper diet and supplementation. you can find one in your area at eatright. org. also see: the 7 missing nutrients in your diet','http://answers.webmd.com/answers/5062866/what-vitamins-could-you-take-for-low-estrogen'),
 (83,'can you take vitamins if you have diverticulitis? . can you take vitamins if you have diverticulitis?','i can see no reason why you couldn\'t take vitamins with diverticulitis unless your doctor doesn\'t want you to take pills during an inflammation phase. if that\'s the case you can take chewables or liquid form until you are able to take whole pills again. also see diet for diverticulitis','http://answers.webmd.com/answers/5063096/can-you-take-vitamins-if-you-have-diverticulitis'),
 (84,'is it possible for one\'s stomach to expand to an enormous size after years of binging? i have never felt full. i was diagnosed with celiac disease in 2013 at the age of 30 but was showing symptoms when i was 10. i have always eaten large amounts (at least 4 times normal serving sizes) and never gained weight. after diagnosis i gained 100 lbs. and i can\'t manage my weight. i try to eat until i feel satisfied but i never am satisfied. i never feel full if i overeat.','the size of your stomach shouldn\'t be a factor in not feeling full. if you were used to eating large amounts of food due to your disease your body likely got used to that. now that (i assume) the celiac is under control. you are still eating the same way but your body is now absorbing the food. weight gain can also change hunger hormones increasing appetite further. i suggest getting help from a dietitian who specializes in eating issues. there are lots of tricks to helping feeling full including choosing filling food and being mindful while eating. you can find a dietitian in your area by going to eatright. org more reading. 9 surprising facts about your stomach satiety: the secret sauce to weight control','http://answers.webmd.com/answers/5064088/is-it-possible-for-ones-stomach-to-expand-to-an-enormous-size-after-years-of-binging-i-have-never-felt-full'),
 (85,'can diabetes or my metformin cause high cholesterol? i was taking prevastatin but my cholesterol is very high. i also had a big steak dinner the night before the test could that make a difference? it confuses me because i eat oatmeal once or twice a day which is supposed to help lower cholesterol plus i am on pravastatin. my doctor just switched me back to simvastatin but i am very concerned. i have a peanut butter sandwich and a half with my breakfast each morning would that make my cholesterol skyrocket?','it is possible that what you ate the night before your blood test could influence your test somewhat (probably not significantly). if you think this is the case you can repeat your test eating like you normally would. but another factor is your blood sugar control. if you blood sugars have been higher lately that could also cause your cholesterol to increase. you can tell this by checking your hemoglobin a1c. a registered dietitian can help sort this all out. you find one in your area at eatright. org or going through your doctor. see also foods that help lower cholesterol. good luck!','http://answers.webmd.com/answers/5062456/can-diabetes-or-my-metformin-cause-high-cholesterol-i-was-taking-prevastatin-but-my-cholesterol-is-very-high'),
 (86,'what are the symptoms of starvation. we are going through tough times and can only afford enough food for our children if we are to pay our basic bills each month until my spouse obtains a job. so that i can best gauge how my husband and i are faring what are the symptoms that our bodies are going into starvation mode or that we are getting to the desperate stage. i know that we must drink more water if we are eating less but that is all i know. thank you.','i\'m sorry to hear you are having a difficult time. here are some symptoms to be aware of: weight loss of 5-10% in 6 months feeling tired change in bowels (constipation or diarrhea) feeling cold (can\'t get warm) losing menses (women) thinning hair and brittle nails getting sick frequently with slow recovery more reading malnutrition symptoms budget eating (dried beans can go a long way)','http://answers.webmd.com/answers/5064415/what-are-the-symptoms-of-starvation'),
 (87,'will brushing my teeth with baking soda and sea salt increase my sodium intake? . i\'m on a low sodium diet.','if you are careful not to swallow it and rinse well afterwards it shouldn\'t count as sodium intake. check with your dentist on how frequently you should be doing this.','http://answers.webmd.com/answers/5065010/will-brushing-my-teeth-with-baking-soda-and-sea-salt-increase-my-sodium-intake'),
 (88,'diagnosed with gestational diabetes. my post prandial blood sugar is often 125 not 120. is that ok? . diagnosed with gestational diabetes. my post prandial blood sugar is often 125 not 120. is that ok?','that seems within the normal range. but what really matters is not one blood sugar level but the overall pattern. that\'s why its recommended you write down what you eat along with your blood sugar levels and show them to a diabetes educator. they work with you on modifying your diet to help manage blood sugars during pregnancy. for more on recommended blood sugar targets see this article.','http://answers.webmd.com/answers/5063931/diagnosed-with-gestational-diabetes-my-post-prandial-blood-sugar-is-often-125-not-120-is-that-ok'),
 (89,'does grapfruit help you loose weight i want to loose 10 pounds','there are no studies showing grapefruit or any other food has unique fat-burning abilities. that being said in one study eating half a grapefruit before meals resulted in significantly more weight loss over 12 weeks compared to those who didn\'t consume grapefruit. this is likely due to grapefruit\'s high water content helping people feel full. but there\'s a lot more you can do to manage your weight including diet changes exercise and getting adequate sleep. good luck! more reading: the grapefruit diet how to lose weight fast and safely','http://answers.webmd.com/answers/5064964/does-grapfruit-help-you-loose-weight-i-want-to-loose-10-pounds'),
 (90,'is frolic acid necessary when taking vitamin b12 1000 methylcobalamin daily. i currently take 1000 mcg b12 methylcobalamin daily now i\'m reading you should combine it w/ frolic acid? is it necessary to add?','it depends on why you are taking it. if it is for b12 deficiency then you take vitamin b12 but with a doctor\'s guidance to monitor blood levels. if you are taking it for high blood levels of homocysteine or to prevent age-related macular degeneration then you take a combination of b12 folic acid and pyridoxine. for more information on dosing side effects and interactions see this link.','http://answers.webmd.com/answers/5064036/is-frolic-acid-necessary-when-taking-vitamin-b12-1000-methylcobalamin-daily'),
 (91,'can rapid weight loss cause hypoglycemia','it may not be the weight loss but rather any changes in eating habits that caused the weight loss. if someone is skipping meals drinking more alcohol exercising excessively and fasting this can increase the risk of hypoglycemia. see your doctor to be sure. for more on the various causes of hypoglycemia see this article.','http://answers.webmd.com/answers/5065122/can-rapid-weight-loss-cause-hypoglycemia'),
 (92,'can b12 vitamins raise lab results. b12 lab results are1241. can taking 1000 mcg of sublingual b12 each day raise lab results?','yes taking high levels of vitamin b12 can increase blood levels. since your levels are high you can decrease it to once a week or not at all if you are getting enough from your diet. for more on testing vitamin b12 see this article.','http://answers.webmd.com/answers/5065361/can-b12-vitamins-raise-lab-results'),
 (93,'my 11 month old will not eat solids. she is still breastfeed but should i be worried about her not getting enough iron. my 11 month old is very picky and does not like the texture of many foods. she will only eat cheeriors crackers or hard breadsticks. she is still breastfeeding but i am worried she is not getting enough iron since her solid food intake is minimal. i\'ve tired iron fortified baby cereal but she will not eat that either. . should i be worried what can i do?','you need to have her iron checked and get a feeding evaluation. start with your pediatrician where they can test her levels and check to see if anything medical is going on such food allergies or reflux. if he doesn\'t find anything ask for a referral to a feeding therapist for an evaluation. this is an important time for feeding and nutrition don\'t delay getting help to find out what is going on.','http://answers.webmd.com/answers/5066050/my-11-month-old-will-not-eat-solids-she-is-still-breastfeed-but-should-i-be-worried-about-her-not-getting-enough-iron'),
 (94,'does drinking too much water and soda before a meal make you feel full that you do not want to eat? . my sons girlfriend allows her children to drink a lot of water and soda right before they eat and then they do not eat. doesn\'t drinking a lot before a meal fill you up and then you are not hungry?','yes drinking fluids especially sugar-sweetened or calorie-containing beverages can cause feelings of fullness resulting in decreased food intake. young children with small stomachs are more likely to fill up than older children and adults. it\'s best to serve calorie-containing beverages with meals. for example juice and milk with lunch or dinner and soda only occasionally. water is the best in between meal beverage. good luck!','http://answers.webmd.com/answers/5059067/does-drinking-too-much-water-and-soda-before-a-meal-make-you-feel-full-that-you-do-not-want-to-eat'),
 (95,'can you become allergic by eating to much of a food?','no over-consumption of a food doesn\'t cause a food allergy. for common causes see this webmd article.','http://answers.webmd.com/answers/5060514/can-you-become-allergic-by-eating-to-much-of-a-food'),
 (96,'what foods should i avoice for meneire\'s disease? . my doctor told me to eat a \"no salt chocolate wine cheese and caffeine diet (a migraine diet? ). can you provide me with an established diet that avoids triggers for meniere\'s?','the mainstay of a diet for menieres is low sodium typically under 2000mg daily. that means focusing on whole foods that naturally have less sodium over processed foods with sodium added. these foods include fruits vegetables whole grains unprocessed meats and healthy fats. when choosing other items read the label. this list should help you figure out low sodium choices. it\'s also beneficial to limit caffeine in items like coffee tea and soda. these are other foods high in caffeine. i think the cheese and wine has to do with migraines and not menieres so you\'ll have to check with your doctor on that. i would focus on sodium first. good luck!','http://answers.webmd.com/answers/5060648/what-foods-should-i-avoice-for-meneires-disease'),
 (97,'can lactose intolerance cause weight gain? if all my food rushes through could my body be overdoing calorie retention? . if all the food i eat constantly rushes through could my body be overcompensating and desperately trying to get calories out of food because it usually \'rushes\' out? . i\'ve timed my body before and high-lactose items last 15 minutes (until desperate release). this sounds like the gi may have to be in high gear just to try to absorb food. if it\'s in this gear when i don\'t have lactose i feel it may be a reason for weigh gain or retention.','although its an interesting theory it\'s not supported by science. lactose intolerance does not cause weight gain. excess weight occurs when you eat more calories than your body burns. in fact people with more serious gastrointestinal problems like ulcerative colitis or crohns have food rush through them and they tend to be underweight and sometimes malnourished. the body does not seem to overcompensate.','http://answers.webmd.com/answers/5060363/can-lactose-intolerance-cause-weight-gain-if-all-my-food-rushes-through-could-my-body-be-overdoing-calorie-retention'),
 (98,'should toddlers take vitamins with omega 3 and vitamin d3','that depends on their diet. most kids need supplemental vitamin d because it not found naturally in many foods and the sun is not reliable. the american academy of pediatrics recommends supplementing with d for children not receiving enough through diet. it would take 6 cups of milk to get the 600iu recommended -- and that would be too much milk for kids anyway. as for omega-3 fatty acids i assume your referring to dha which is important for health and brain development in babies and young toddlers. if a toddler eats fish about twice a week (small portions) than it\'s not needed. if he doesn\'t eat any fish you may want to consider supplementing. fortified foods have some but not as much as in fish.','http://answers.webmd.com/answers/5059722/should-toddlers-take-vitamins-with-omega-3-and-vitamin-d3'),
 (99,'can proper nutrition help kidney disease. someone said that the foods you eat can slow down the progression of kidney disease. is this possible?','diet is one component of slowing down kidney disease but so are regular visits to your doctor and taking prescribed medications. for example keeping blood sugar under control if you are diabetic will help your kidneys as will keeping blood pressure in normal range. that is a mix of diet and medications. it\'s also important for you to understand what you doctor or dietitian recommend in terms of protein potassium sodium fluid and phosphorous levels in your diet. recommendations will vary depending on whether or not you are on dialysis and your labs. make sure you have a good healthcare team to help you out. also see kidney disease: changing your diet good luck!','http://answers.webmd.com/answers/5062707/can-proper-nutrition-help-kidney-disease'),
 (100,'i was diagnosed with uc in 2011. i\'m obese and considering gastric bypass. can i have the surgery with my condition? . i have tried every diet out there but nothing has worked for me. i would like some facts on if this is safe.','the best thing to do if you are serious about weight loss surgery is to visit a bariatric surgeon\'s office. these clinics have a team of people including the surgeon dietitian psychologist and nurse. the doctor can inform you if he things you are a candidate from a safety perspective and sometimes insurance requires a 6-month program first. these professionals are experienced in helping people like you make the right decision. also see i s weight loss surgery for you? good luck!','http://answers.webmd.com/answers/5062664/i-was-diagnosed-with-uc-in-2011-im-obese-and-considering-gastric-bypass-can-i-have-the-surgery-with-my-condition'),
 (101,'my son was born a noneater but he changed at 6 (now 12) and now overeats. i was wondering how and why this happened.? . my son was born a nonfood enthusiast. he was always the last person to wrap up lunch in preschool and it was never done. his blood sugar was low and he weighed little. he felt sick at the sight of food. all that changed in grade 1 and we were all delighted that he would eat. by the end of the year though he was overweight and he overate. i thought it was a phase since he was not by nature like that; it was sudden. he is still however and i was wondering how it could suddenly change.','there could be many reasons. first off kids experience increases in their appetite around school age and they also start to lose some of that fear of food they had that research shows peaks between 2 and 6. it could be that because he has always been told to eat that once he got more of an appetite he didn\'t know how to listen to his body. in his mind more is better. this happens often as parents worry their young child doesn\'t eat enough or even doctors tell parents to get in as much food as possible. at school age children also become more influenced by their food environment and often want to eat what their friends are eating. food advertising also plays a role. the key is to get on track now. structure balanced meals at the table and encourage him to listen to his body -- using hunger and fullness to guide eating. regular activity of an hour a day is also recommended as is good sleep at night. avoid restrictions or making a big deal of his weight -- the whole family should have healthy habits. also see 10 ways to raise food smart kids a lot will depend on why he didn\'t like to eat in the first place. if he didn\'t want to eat because of a neurotransmitter imbalence for example maybe it reversed itself too far the other way. like he always felt full before but now he always feels hungry.','http://answers.webmd.com/answers/5062754/my-son-was-born-a-noneater-but-he-changed-at-6-now-12-and-now-overeats-i-was-wondering-how-and-why-this-happened'),
 (102,'should liver cancer patient consume significantly less water per doctor\'s instruction? why is this? . the male patient is very old age 98 and has liver cirrhosis with digestion issues. the doctors advised not to consume more than 1 liter liquid per day including all contents of liquid in the various forms of meals that are consumed. why is water is not good for liver with problems? dehydration and weakness due to loss of energy with reduced food intake and water consumption is questioned. water intake should help body to retain strength and energy. your response would be appreciated.','often times with liver disease like cirrhosis edema or what is often referred to as ascites occurs which means fluid accumulates in the abdominal cavity putting pressure on other organs including the kidneys. while the patient can still be dehydrated too much water can cause the fluid accumulation to worsen. sodium levels can also decrease and fluid is then restricted. if you are not interested in aggressive therapy at this point in his care talk to his doctor about other treatment options. good luck!','http://answers.webmd.com/answers/5062879/should-liver-cancer-patient-consume-significantly-less-water-per-doctors-instruction-why-is-this'),
 (103,'i have started a low-sugar and low-wheat diet and i keep going to the toilet more than normal. is my diet the reason?','the question is how else has your eating changed? if your low sugar and no wheat diet also includes more fruits and vegetables and other sources of fiber like beans then you have your reason (fiber makes food go through the intestine faster). i don\'t think just removing sugar and wheat would cause you to go to the bathroom more but its likely due to any other changes you are making. if you feel the changes are a problem see your healthcare provider.','http://answers.webmd.com/answers/5061869/i-have-started-a-low-sugar-and-low-wheat-diet-and-i-keep-going-to-the-toilet-more-than-normal-is-my-diet-the-reason'),
 (104,'what fruits/vegitables can i mix in a blender to make a healthshake that has all the viamins/nutrients of a multivitamin. i\'m wanting to make a shake that is 20oz or less that has all the vitamins and nutrients i need. i read that multivitamins like centrum or shakes like ensure are somewhat ineffective because the vitamins don\'t absorb as well as they do from natural foods. . so what i want to do is make a drink that will replace my daily multivitamin. i want it to be made from as few ingredients as possible and not taste too horrific. any advice or resources would be greatly appreciated. <positive_smiley>','i think what you may have read is its better to get nutrients from food because of the other health benefits such as fiber and antioxidants. it\'s true that you will likely absorb more from food because the nutrients are not provided in one dose like a multivitamin. for example calcium is better absorbed when giving through out the day instead of one big dose. it would be impossible to put together a drink with food that had 100% daily value of vitamins and minerals like a multivitamin has. instead work to get the recommended amount of food in your daily diet. smoothies with fruits vegetables and yogurt can help you meet your produce goal (5 or more daily). to figure out your needs based on your indiviual needs go to choosemyplate. gov','http://answers.webmd.com/answers/5052593/what-fruitsvegitables-can-i-mix-in-a-blender-to-make-a-healthshake-that-has-all-the-viaminsnutrients-of-a-multivitamin'),
 (105,'is paleo diet recommended by doctors? . i am very interested in this diet but i am not sure if its safe. what is opinion of professionals?','the paleo diet is not mainstream yet meaning most doctors probably wouldn\'t recommend it. this may change as the research grows. the benefits of the diet include a focus on whole foods over those that are highly processed such as cookies. it also focuses on vegetables and fruit along with lean meats fish and nuts. the question part is that it excludes two food groups and one class of protein foods -- dairy products grains and beans. according to one assessment a carefully planned paleo diet can meet most needs except for calcium (671mg) and vitamin d but provides 4 times the rda for protein and less than is recommended for total carbohydrates. supplementation may be needed. and we don\'t know the long-term risk of a diet so high in animal protein as some research suggests it may have adverse health risks (see latest study). also there\'s the reality that while it may bring great results in terms of weight loss it may be challenging to adhere to long-term especially if you like the foods that aren\'t allowed. view this <link>','http://answers.webmd.com/answers/5054660/is-paleo-diet-recommended-by-doctors'),
 (106,'its been 14 years since i had weight loss surgery. i am 190lbs 5\' tall can i have surgery again?','your best bet is to get follow up either from your doctor who did the surgery or another surgeon. they will check in with your labs diet and offer suggestions. the bariatric team (consisting of rd psychologist rn and surgeon) can weigh in on whether or not another surgery is necessary. an important part of the follow up will be for the surgeon can check to see if there are any problems with your original surgery etc. regular follow up is really important for anyone who has had weight loss surgery so that is the best place to start. good luck!','http://answers.webmd.com/answers/5052530/its-been-14-years-since-i-had-weight-loss-surgery-i-am-190lbs-5-tall-can-i-have-surgery-again'),
 (107,'can taking biotin cause yeast infections? . i have been taking biotin (5000mg) once a day for the last 3 weeks since i have been taking it i have noticed 2 things my urine smells extremely bad and i have been experiencing symptoms close to yeast infections burning when urinating. i notice it happens after i take the pill in the morning would it help to take it at night? . . i am taking it as a routine vitamin for hair and nails. not medically necessary','that is a large amount to take considering the recommended amount for adults is 30 micrograms. i would check with your healthcare provider on the amounts and possible medical connections. i can find no reason to think it would cause a yeast infection. for side effects and more info see this webmd listing. i too have had a similar experience with taking the biotin. i don\'t typically suffer yeast infections and the only new thing added to my regime has been the addition of biotin (5 000 mcg) yet i\'m undergoing what i\'m sure is a yeast infection! i\'m thinking to stop taking it. what did you decide to do?','http://answers.webmd.com/answers/5052737/can-taking-biotin-cause-yeast-infections'),
 (108,'can black pepper be used on low redidue diet?','because a low residue diet is one that is low in fiber pepper is not typically excluded. if you have specific questions about your individual needs ask your doctor or dietitian.','http://answers.webmd.com/answers/5056382/can-black-pepper-be-used-on-low-redidue-diet'),
 (109,'my 14 yr old daughter has high cholesterol but normal triglycerides. also rapid weight gain at puberty stretch mark. her body seems puffed much like someone who is overfed starches. her legs and arms are also hard not fatty at all. as soon as puberty hit she rapidly gained weight and has numerous stretch marks. her energy level is also low.','there\'s a lot going on at puberty that could be contributing to your daughter\'s weight eating and cholesterol. first off weight gain especially around the middle for girls is normal and to be expected as she is going through the second largest growth spurt of her life. but if she is not being fed well balanced meals at regular intervals excess weight and unhealthy habits can occur. also this is a time when iron deficiency risk increases with the onset of regular periods which can cause low energy. i suggest you visit her doctor and get blood work done including iron levels to check to see if she is deficient. second providing regular balanced meals at the table and involving her in meal preparation should help get her eating on track. regular physical activity is important too. but please avoid dieting and making weight an issue as research shows it backfires. for more on healthy eating during the teen years see this webmd article.','http://answers.webmd.com/answers/5057878/my-14-yr-old-daughter-has-high-cholesterol-but-normal-triglycerides-also-rapid-weight-gain-at-puberty-stretch-mark'),
 (110,'what can i do to prevent perimenopause weight gain. i\'ve been working out at the gym for over a year now and i\'ve been watching what i eat (weight watchers at home) and i\'m still struggling to loose weight and its been frustrating what am i doing wrong?','there is a difference between preventing weight gain and losing weight. research shows exercise of about an hour a day is protective for weight gain during midlife. also resistance training is key to help maintain muscle mass because gradual muscle loss is part of the reason women gain weight with age. i guess the question is is your weight in a healthy range now? if it is it might not be realistic to expect it to stay the same throughout this time or lose it to be at a weight you used to be. if your numbers are good (cholesterol etc. ) and your blood pressure is normal overly focusing on weight may not be helpful to your health or quality of life. but if you feel the extra weight isn\'t good for you or you have risk factors than i highly suggest you see a registered dietitian. you can find one in your area at eatright. org also see weight loss menopause and exercise tips','http://answers.webmd.com/answers/5062163/what-can-i-do-to-prevent-perimenopause-weight-gain'),
 (111,'besides medication for blood pressure what is my next move? . recently my blood pressure has spiked up and my weight has well. i know exercise is needed. what else can i can do besides taking blood pressure medication.','in addition to exercise what you eat can help a great deal. the dash has been shown to help reduce blood pressure and it focuses on the following: a variety of fruits and vegetables a diet low in saturated fat and red meat protein sources such as fish lean poultry and nuts whole grains (whole wheat brown rice) over refined grains (white bread white rice) reduced sodium and less sweets in the diet for more recommendations on how to follow the dash diet see this post. good luck! talk to your family doctor and make appointment to see a nutritionist. you are what you eat and having high pressure means you should decrease your salt intake and less greasy or fried food. and there are certain food you should avoid and other you should eat to help lower the blood pressure. if you are not eating right your condition won\'t improve just from medication. if the condition get worst you might need surgery','http://answers.webmd.com/answers/5056730/besides-medication-for-blood-pressure-what-is-my-next-move'),
 (112,'am i getting too much vitamin a? . for the last couple of months i have been on a unusual diet of mostly ceasar salad and yams. now i eat around a full heart of romaine lettuce a day and a large yam a day. the diet works great but i didn\'t look at the vitamin count. i recently noticed that i have been consuming a large amount of vitamin a. i don\'t take any supplements but i am now worried that i might have vitamin a toxicity. i looked up some of the symptoms and i don\'t think i have any but should i stop this diet?','while it may turn your skin yellow/orange vitamin a from fruits and vegetables is not toxic. but you do need to worry about missing out on other key nutrients. if all you are eating are yams and romaine lettuce you may not be getting enough fat protein and are at risk for other vitamin/mineral inadequacies like vitamin d. i suggest seeing a registered dietitian to develop a balanced eating plan to help you be healthy and lose weight if needed. good luck!','http://answers.webmd.com/answers/5058015/am-i-getting-too-much-vitamin-a'),
 (113,'what can i do to increase my potassium? . i already take a potassium supplement. so i am taking two a day now. i also was already eating several bananas a week. i am eating at least one a day now. i already eat pretty much all of the foods that contain potassium so i don\'t know what to do. i am doing this by doctors orders but am now more tired than ever and having soft stools and frequent urination too. i go back for more tests in a few days but don\'t feel better at all (worse actually). what else can i do? !','having low potassium is not always due to diet but fluid balance. that\'s because potassium along with sodium helps regulate body fluids (they are called electrolytes) so when fluid changes occur with certain disease states or medications like diuretics it can go too low or high. diet cannot always correct changes in potassium so working with your doctor on the appropriate medical management will be key. if you are getting worse call your doctor to see if you need to go in earlier. it is important to know which foods have potassium and how to balance your intake which this webmd article discusses in detail. also eating well moderate exercise and good sleep will only help you feel better. hope you feel better soon! finding the cause for your low potassium needs to be the first objective. here is a list of some possible reasons for low potassium: 1. ) sometimes low potassium is a symptom of some other problem. for example having low magnesium l evels can be a contributing cause for low potassium. it may be difficult in these cases to stabilize potassium levels until magnesium levels are increased. routine serum blood studies do not always uncover low magnesium. 2. ) consuming foods that are insufficient or lacking in nutrients necessary to maintain potassium at an optimal level can be a real challenge. yes consuming foods that are rich in required nutrients is a worthy objective. but due to hectic life styles and the frequent fast eating of fast foods your diet may come-up lacking in potassium. 3. ) some medications can cause low potassium levels. be especially careful in taking laxatives and diuretics which can deplete potassium levels. 4. ) electrolyte imbalances as seen with vomiting and diarrhea can also cause potassium levels to plummet. 5. ) some digestive irregularities as seen in conditions like crohns disease gluten sensitivity issues and irritable bowel syndrome can cause fluid loss and ultimately to cause low potassium levels. 6. ) drinking alcoholic beverages to excess drinking large amounts of tea coffee and soda can cause excessive urination and result in potassium depletion. here are my recommendations as a lay person who has had family members suffering the negative effects of having low potassium levels : - start a food diary listing as best you can (with only a few days until your follow-up appointment) all foods and beverages that are being ingested. also annotate any physical or emotional symptoms like excessive sweating feeling anxious muscle cramps lightheadedness thirst and overall body weakness. - for the immediate time follow your doctor\'s plan of action. keep that appointment with your doctor to follow -up with the results achieved. - show your diary to the doctor along with an updated list of all prescription medications and over the counterdrugs. that person has been highly trained in nutrition pharmacology and medical conditions. digestive problems absorption defects low magnesium levels and many other problems may be uncovered by your physician who is also a diagnostic detective. - once the cause of your low potassium level is determined then an effective treatment plan may be started. hi this first bit is from the uk paper the daily mail. this is an interesting question because although potassium is rarely in the limelight we actually need it in higher amounts than any other mineral - around 3 500mg a day by adult men and women. potassium plays a fundamental role in maintaining the fluid and acid/alkaline balance of the body. it is vital for the transmission of nerve impulses and helps the heart to beat regularly. it also counterbalances sodium in the body and is known to help lower blood pressure. to get enough you need to eat plenty of fruit and vegetables which are especially good sources because they also provide a low level of sodium. (health-wise it\'s a high potassium to sodium ratio that really counts). however several other foods also provide potassium including whole bread and pasta brown rice milk fish and meat. the dietary and nutritional survey of british adults (hmso 1990) showed that the average intake of potassium is 3 187mg in males and 2 434mg in females. compared with the daily recommendation of 3500mg intakes they are therefore low. to make up the difference eat an extra banana or two daily - each banana contains around 400mg. people most at risk of marginal potassium include the elderly athletes and manual workers who sweat out a lot of potassium and people taking certain diuretic drugs. heavy coffee and alcohol drinkers may lack the mineral and should try to increase their dietary intake i think from this and other stuff around with your supplements you should be getting there but keep of any fast foods junk foods and sodas just keep eating healthy. do hope this helps good luck ps the extra urination is from all the fruit your eating same as the soft stools.','http://answers.webmd.com/answers/5053235/what-can-i-do-to-increase-my-potassium'),
 (114,'i need to be on a low potassium and low protein diet. i would like to know what food am i allowed to eat? . i have celiac disease and chronic kidney disease','here is a good tutorial to help you limit potassium and protein in your diet. be sure to stay in touch with your doctor as your diet needs may change depending on your kidney function or various treatments (like starting dialysis). potassium is found in many fruits and vegetables including potatoes tomatoes oranges dark green leafy greens pumpkin and cantaloupe. focus on low potassium produce like apples carrots corn mushrooms blueberries and cucumbers. as for protein be sure to ask your doctor or dietitian how many grams you are allowed which is usually based on weight. one ounce of meat has about 7g of protein but you\'ll want to read labels on other food items. if you go on dialysis your protein needs will increase. good luck!','http://answers.webmd.com/answers/5057753/i-need-to-be-on-a-low-potassium-and-low-protein-diet-i-would-like-to-know-what-food-am-i-allowed-to-eat'),
 (115,'could you provide a few links to the major studies showing excessive saturated fat is unhealthy? . this website and the american heart association continue to recommend a diet low in saturated fat. but the current buzz on the internet is that there is really little evidence for that position. in fact france eats a diet high in saturated fat yet has a low rate of deaths from heart disease (<link> <link> ). can i see links to the original studies showing sf is harmful?','most helpful answer there has been a backlash against low fat diets leading people to go in the opposite direction embracing diets high in saturated fat diets. the truth is diets low in saturated fat won\'t reduce heart disease risk if the saturated fat is being replaced with refined carbs. this decreases hdl (good cholesterol) and can increase triglycerides and the blood sugar response. but as both of the review studies below demonstrate when saturated fat in the diet is replaced with plant and fish sources of fat (omega-3 fatty acids and monounsaturated and polyunsaturated fats) it decreases heart disease risk -- hdl increases and ldl (bad cholesterol) decreases. <link> <link> this is basically the mediterranean diet -- low in saturated fat high in fruits and vegetables and healthy fat sources like olive oil and nuts. while the french may have diets higher in saturated fats they also tend to be leaner walk more and eat other heart healthy foods like fruits and vegetables. while the evidence continues to evolve there isn\'t enough to recommend a diet high in saturated fat to reduce heart disease. yes some propit change to lipid and make your belt bigger. see more here hi for those who have interest in saturated fat have a good read through this one site there is lots on it. <link> just copy link into google to the www. to open and read. should help some of you. good luck our old belief was that saturated fat have the ability to raise cholesterol levels and give us heart attacks but s everal recent review studies that combined data from multiple other studies found that there really is no link between saturated fat consumption and heart disease h owever it\'s a fact that replacing saturated fats with unsaturated fats reduced the risk of cardiac events by 14%. so it\'s always better to stay away from a fatty body. i had a very fatty body from my childhood it self but by doing a plastic surgery procedure at montreal omar fouda neel clinic i reduced overall body fat and there by weight. i think the links you have are pretty awesome. sf\'s are great just really need to have them in moderation i would think.','http://answers.webmd.com/answers/5045325/could-you-provide-a-few-links-to-the-major-studies-showing-excessive-saturated-fat-is-unhealthy'),
 (116,'can vitamins or supplements help bradycardia? i have bradycardia from exercising. thanks. detected through annual physical exam. low heart rate exercise stress test.','i don\'t know of any vitamins or supplements that help bradycardia. in some cases low heart is not a problem if it is due to being fit but only your doctor can tell for sure. this webmd article provides more information on potential causes. sometimes bardycardia is caused by an electrolyte imbalance (potassium and sodium levels become out of whack). if you haven\'t already you can get your blood work checked to determine if any of your levels are too low or high. you can also check iron vitamin d and vitamin b12. if any of your levels are low supplementation may be needed. good luck!','http://answers.webmd.com/answers/5045032/can-vitamins-or-supplements-help-bradycardia-i-have-bradycardia-from-exercising-thanks'),
 (117,'how to daily chart salt intake. i need to reduce the amount of salt in my diet yet i know the body needs some amount to maintain health. i\'m looking for a chart i can plot what i eat to determine how much salt i\'m ingesting. . i\'m 70 years old in excellent health except for this darn bp problem. i\'m been a ballet student for 40 years currently dancing 2 days a week for 1 1/2 hours in an advance ballet class. i see my health professionals regularly and always great dental checkups. thanks for helping me with my need','the american heart association has this sodium tracker: <link> there are also various apps you can use if you have a smart phone. just do a search online and read review to pick the best one. make sure you get nutrition information from restaurants and read labels. here are some articles that might help: range of sodium content for common foods reduce salt in your diet low sodium recipe tips i use fatsecret. com. you can log in your foods and choose the settings you would like (for instance) protein fat sugar sodium fiber. it will allow you to track 5 at one time. it will give you how many grams you are eating per day based on the foods you input.','http://answers.webmd.com/answers/5045469/how-to-daily-chart-salt-intake'),
 (118,'foods to bring down your blood sugar naturally. i would like to know what foods to eat to bring down my blood sugar naturally. i do not want to take any of the shots as they cause cancer and there is enough cancer in my family line now.','by shots i assume you mean insulin. the key to bringing down your blood sugar is to track your carbohydrates since they are what raise blood sugar. foods rich in carbohydrates include bread/grains beans fruit milk and yogurt and added sugars such as those in sweet foods and beverages. foods rich in protein and fat do not raise blood sugar like carbohydrates do. protein foods include lean meats poultry fish eggs and tofu. fats are items like butter vegetable oil nuts and seeds and avocado. vegetables are typically recommended because they are low in carbohydrates but high in nutrients. so they can be consumed in large amounts. the key is to include healthy carbohydrates in controlled amounts while including protein vegetables and healthy fats with meals. if you consume sweetened beverages switch to water. i highly recommend seeing a diabetes educator to help you put it all together. below are some articles that might help: healthy diabetes diet 6 foods that may help control your blood sugar how does my diet affect diabetes? cinnamon fenugreek garlic avocados and nuts blueberries which are also a great source of soluble fiber and a number of other important nutrients red cherry vinegar can help you in lowering the blood sugar. <link> top essay writing service','http://answers.webmd.com/answers/5046667/foods-to-bring-down-your-blood-sugar-naturally'),
 (119,'can i take a multi vitamin with adipex-p. i have been taking a multi-vitamin and b-12 for a while now and the dr just recently put my on adipex-p for my weight loss can i still take my vitamins?','i see no reason why you cannot take your multivitamin and b12 but you should always share what you are taking (drugs/supplements/herbal remedies) with your doctor. here you can see more about precautions and interactions when taking adipex-p.','http://answers.webmd.com/answers/5045452/can-i-take-a-multi-vitamin-with-adipex-p'),
 (120,'are there certain foods that should be avoided after ones gall badder is removed?','because the gallbladder is a storage space for bile that breaks down fat (originally produced in the liver) you\'ll need to watch your fat intake. while the body eventually adjusts to not having a gallbladder every person is different in how their body reacts. you\'ll want to keep the following points in mind for your diet moving forward: consume small frequent meals over large infrequent ones. avoid greasy foods high in fat such as fried food and creamy sauces. and when you do choose to eat these foods consume them in small amounts. gradually increase fiber in your diet (fruits vegetables and whole grains) to help move food through your intestines. keep a food dairy to note foods that may not be tolerated. some people who have had their gall bladder removed notice foods like dairy are more difficult to tolerate. if you are noticing many symptoms see a registered dietitian for help. i t have removed my gallbladder 8 months ago and i always feel pain when i consume meals high in fat. and its true that every person reacts in different way to food. so just monitor your food intake and your reaction to it. if you ever felt uncomfortable then you should lower its intake. saturated fats. everyone should avoid these! saturated fats are the fats that at room temperature solidify. such as bacon grease the fat in the pan of ground beef melted margarine that cools down and becomes solid again. these are some of the fats that get into the arteries and eventually clog them causing heart attacks and strokes cut out or at least down on the cholesterol too as well as the triglycerides. as many physicians and nurses recommend consult with a dietitian they will help.','http://answers.webmd.com/answers/5051692/are-there-certain-foods-that-should-be-avoided-after-ones-gall-badder-is-removed'),
 (121,'which food that i should take and avoid to banishing belly fat? . i often run on treadmill 20 mins everyday but there\'s no changes in my belly fat. i\'m 22 years old 64kg and my belly size is now 80 cm.','although there aren\'t specific foods that are known to reduce fat around the belly following overall healthy diet will help. you also need to manage how much you are eating and keep up regular exercise. here are some tips: include more fiber in your diet including fruits vegetables whole grains and beans and legumes. listen to feelings of hunger and fullness stop eating when comfortably full and eat regular meals and snacks. watch for excess intake of beverages with excess calories like beer soda and coffee drinks. gradually add more exercise -- an hour of moderate activity is recommended on most days. strength training can also help. if you have trouble doing it on your own find a registered dietitian in your area by going to eatright. org. for more on belly fat and what you can do see this webmd article','http://answers.webmd.com/answers/5053069/which-food-that-i-should-take-and-avoid-to-banishing-belly-fat'),
 (122,'is my diet effecting my hair? help please! . i have always had bone straight hair. i am 36 years old no kids. after a month or two of dieting my hair turned wavy and unmanageable. my diet consists of chicken almonds sunflowers an apple a day salads tomato basically protein vegetables and eggs. no carbs no bread no fruit other than an apple a day. i exercise (mostly walking) daily. i drink plenty of water. is this diet causing the change to my hair? it seems my hair went from bone straight to wavy/unmanageable over night.','following a low carb diet and restricting calories can cause hair loss or changes in growth which could be why your hair has changed. hair needs sufficient calories and nutrients to grow. it\'s important when you cut out food groups like fruit and grains that you replace nutrients in those foods like b vitamins and vitamin c. extreme low carb diets are not recommended long-term. remember that carbohydrates are thebody\'s preferred fuel source and it plays an important role in good health. for more on how dieting effects hair health see this article also of interest may be top 10 foods for healthy hair','http://answers.webmd.com/answers/5060326/is-my-diet-effecting-my-hair-help-please'),
 (123,'can a panic attack/hyperventialing cause blood sugar to rise? . my son had his glucose test for cf yesterday and while he was waiting for the 2 hour results he had a panic attack and began sobbing uncontrollably and hyerventilating because he was hungry and realized he couldn\'t eat for 2 hours (the clinic messed up and they had to put off his initial drinking of the glucose for 3 hours after he had already been there). anyway his fasting glucose was 86 his a1c was 5. 2 but when they did his post fasting it was 206.','i cannot find anything linking panic attacks to high blood sugars. it seems plausible that increases in stress hormones during a panic attack could temporarily increase blood sugars. your son\'s a1c and fasting glucose are normal so the high blood sugars are not caused by diabetes.','http://answers.webmd.com/answers/5051990/can-a-panic-attackhyperventialing-cause-blood-sugar-to-rise');
INSERT INTO `dataset` (`Id`,`Question`,`Answer`,`URL`) VALUES 
 (124,'i have tried claritin and today took the last of zyrtec. i still have allergy symptoms. should i try benadryl?','you haven\'t been on one medication long enough for it to get into your system to work. diphenhydramine the active ingredient in antihistamines like benadryl would be a last resort due to the side effects that include a \"hangover\" feeling dry mouth constipation and dizziness. do you tune into your weather forecast to check the pollen counts? if they are high you will continue to have your symptoms. stay on one product during the allergy season and if after a week or so you do not seem to be getting better see your doctor or health care provider; you may need prescription medication. this is an example of something you can talk to your pharmacist about.','http://answers.webmd.com/answers/1182569/i-have-tried-claritin-and-today'),
 (125,'what foods or drinks can help my blood pressure?','there is a well researched diet for high blood pressure called the dash diet standing for dietary approaches to stop hypertension. here are the basics of the diet: low in sodium no more than 2300mg sodium (the average sodium intake in the american diet is 3 500). reading labels is key. plenty of fruits and vegetables which contain potassium an important nutrient to help lower blood pressure. try including sources at every meal. some ideas include cutting fruit up ahead of time for quick meals fruit and veggie smoothies in between meals and green salads with lunches and dinners. 2-3 servings of low fat dairy foods such as milk yogurt and low fat cheeses. nuts seeds and legumes most days of the week healthy fat sources such as olive oil instead of butter limited amounts of sweets no more than 5 times per week alcohol in moderation -- no more than 2 per day for men and 1 for women for more details on this diet see this webmd article. there\'s a lot you can do to lower your blood pressure. good luck!','http://answers.webmd.com/answers/5039866/what-foods-or-drinks-can-help-my-blood-pressure'),
 (126,'how often can i use medicated sprays or drops?','it depends on which products you are using. over-the-counter (otc) products have directions on the label with age-specific dosage instructions as well as uses warnings and possible side effects and storage information. decongestant ointments and sprays can cause rebound nasal congestion if used for an extended period of time. if you ever have questions about over-the-counter medications be sure to ask your pharmacist.','http://answers.webmd.com/answers/1182568/how-often-can-i-use-medicated'),
 (127,'biotin & digestion. after stumbling upon an article in my health textbook i found that biotin is actually essential to digestion & also produced in the colon! i thought the biotin was what was causing my digestive issues (being constipated after the morning \'go). how is this possibl? . omy doc says i could have irritable bowel because my mother has it. i am 19. don\'t want to ask my dr. cause i want a second opinion on this.','biotin is involved in the breakdown of carbs protein and fat but i have never heard it being used to treat digestive issues. additional biotin would only help if there was a deficiency which is not common (see this article for symptoms). you could always take a multivitamin which would cover you. i recommend addressing your diet and how to improve it to help your symptoms. getting a second opinion and seeing a registered dietitian who specializes in digestive issues can help. good luck! read more: constipation digestive disorders i bs with constipation','http://answers.webmd.com/answers/5039962/biotin-digestion'),
 (128,'will replacing full sugar soda with diet soda help one lose weight? . i keep seeing the same study cited over and over again claiming diet soda causes one to crave sweet things and may induce people to overeat. this has not been my experience and replacing sugar soda with diet soda has helped me lose weight and keep it off. is there any scientific consensus about this? just searching \"diet soda and weight\" on google gives a bunch of pages that keeps citing the same few studies.','t his article on webmd explains the science and that yes websites and blogs tend to focus on the diet soda and weight gain and weight gain angle even though the evidence is scant. studies show that when used with a reduced calorie diet non-caloric drinks help people lose weight. there is some concern that regular diet soda consumption increases the risk for heart disease and stroke. but more studies are needed to confirm a relationship. if you find it works for you then that\'s all that counts. just keep an eye out for research on the health effects. good luck!','http://answers.webmd.com/answers/5041941/will-replacing-full-sugar-soda-with-diet-soda-help-one-lose-weight'),
 (129,'my child wants to eat constanly and is on concerta for adha. dont know if symptom or eating disorder. she use to have curbed appetite being on the medicine but now eats non stop. gorges herself and thinks she is hungry non stop.','most helpful answer although the medication she is on often decreases appetite it can increase appetite in some people. i would visit a pediatric dietitian for an evaluation to make sure nothing else is going on. you can find a dietitian near you at eatright. org. in the meantime here are some things you can do at home: structure meals and snacks at the table and don\'t allow grazing between meals. provide a variety of food groups at meals (2-3 at snack and 4-5 at meals) especially protein rich foods and fiber (fruits vegetables whole grains beans) that help increase feelings of fullness. allow treats but provide them less often. encourage her to listen to feeling so fullness and remind her she can have more food at the next meal etc. allow at least an hour of day for physical activity. good luck!','http://answers.webmd.com/answers/5046471/my-child-wants-to-eat-constanly-and-is-on-concerta-for-adha-dont-know-if-symptom-or-eating-disorder'),
 (130,'i weigh 180 pounds and i want to lose 30 pounds. what is the fastest yet halthiest way i can achieve this? . i can barely go to the gym because of my hectic schedule and when i do its only for about 20 minutes because that is seriously all i can afford. people have suggested this thing called the 3 day diet but i think after that i will just gain it all back. people have also suggest a no carb no sugar diet but i really have no idea what that consists of. before i went to college i weighed 130 pounds i want to meet somewhere in the middle and be 150 which is a normal weight for being 5\'9. . please help','there are lots of healthy ways to lose weight but the key is to determine why you gained weight the the first place and work on that. is it a lack of activity? stress? not planing meals? poor cooking skills? diets work short-term but are more difficult to sustain over the long haul when those same issues that cause the weight gain come back. why go to the trouble of losing weight if your likely to gain it back? i suggest seeing a registered dietitian (you can find one at (eatright. org). a dietitian can help you figure out why you have gained weight and develop a realistic plan for moving forward and gradually losing weight. good luck! for more reading see: 5 surprising reasons you\'re gaining weight','http://answers.webmd.com/answers/5041913/i-weigh-180-pounds-and-i-want-to-lose-30-pounds-what-is-the-fastest-yet-halthiest-way-i-can-achieve-this'),
 (131,'what is ideal level of hydration? is there a formula regarding height and weight?','there are no recommendations of fluid by weight. it is generally accepted that drinking to thirst should be adequate unless you have certain medical conditions participate in intense or prolonged exercise or live in hot climates. the institute of medicine does have general fluid guidelines -- 11 or more cups per day for women and 15 or more for men. this includes fluid from food and beverages (even caffeinated drinks like coffee). see this article for more information.','http://answers.webmd.com/answers/5052039/what-is-ideal-level-of-hydration-is-there-a-formula-regarding-height-and-weight'),
 (132,'is vitamin k the same thing as potassium. the reason i ask this question is because i have been taking lisinopril 20 mg twice a day. plus omega 3-6-9 twice daily. plus alive vitamin for women 50+ once a day. and i am worried about getting too much potassium. i did not know if vitamin k is the same thing as potassium. this vitamin does not list potassium or iron. so i figured it would be safe for me to take. also since i take 40 mg daily of lisinopril. would it hurt me to eat an occasional banana.?','i just checked the alive vitamin for women 50+ and it does not appear to have potassium added. vitamin k is not the same thing as potassium. potassium is usually not added to multivitamins. you need to talk to your doctor about whether or nor you can have potassium rich foods like bananas while you are on lisinopril.','http://answers.webmd.com/answers/5051065/is-vitamin-k-the-same-thing-as-potassium'),
 (133,'is 105 mg of vitamine b12 a dangerous dosage? . i am taking a multivitamin tablet that contains 100 mg with methycobalmin? and 5 mg of b12 as methycobalmin andadenosylcoalmin? am i taking too much daily of this vitamin?','i think you mean micrograms (mcg) instead of milligrams (mg). if you really are taking 105mg that would equal 105 000mcg. the recommended amount of vitamin b12 for adults is 2. 4mcg. but there is no upper limit set by the institute of medicine because no adverse effects have been found with taking excess vitamin b12. because it is a water soluble vitamin it\'s potential for toxicity is low. most people get enough from diet unless they are vegetarians older or have a health condition that decreases the absorption of vitamin b12. for more on proper dosing and side effects see this webmd page.','http://answers.webmd.com/answers/5042061/is-105-mg-of-vitamine-b12-a-dangerous-dosage'),
 (134,'is gaining weight and hemorroids a sign of menopause? . does weight gain and hemorrhoids have anything to do with menopause? i have gained a lot of weight and just recently got hemorrhoids. i haven\'t had my period since february 2013. is it possible for someone only 32 yrs old to go through menopause?','it is possible to go through premature menopause before 40 but only a doctor can say for sure. weight gain especially in the midsection is related to menopause because the ovaries no longer produce estrogen and this changes the way fat is metabolized. hemorrhoids are not commonly associated with menopause and can happen to anyone especially if they are inactive drink little water and consume a diet low in fiber. not getting your periods is a serious manner so i highly recommend you see a doctor to rule out menopause or other health issues that could be going on. don\'t delay! for more on premature menopause see this webmd article','http://answers.webmd.com/answers/5042090/is-gaining-weight-and-hemorroids-a-sign-of-menopause'),
 (135,'can u give a child simply garcinia. that is 75 pounds over weight','i would not rely on a supplement to help a child lose weight. first off dietary supplements aren\'t regulated by the fda and their safety is not known. second no supplement alone can solve a weight problem. you need to find out why your child is carrying extra weight and work to change it. i highly recommend you see a pediatric dietitian who can help you learn not just what to feed your child but how to feed them. children are still growing so special care needs to be taken when it comes to diet and how they are treated about weight to prevent disordered eating. you can find a dietitian in your area at eatright. org','http://answers.webmd.com/answers/5042128/can-u-give-a-child-simply-garcinia'),
 (136,'is mineral water good for your diet. can mineral water replace vegetables in a healthy diet','all water is beneficial for health. the amount of minerals in mineral water is minimal and should not be considered substitute for eating fruits and vegetables. fruits and vegetables contains high amounts of vitamins and minerals but also contain fiber and antioxidants that help maintain good health. here\'s some help getting started eating fruits and vegetables. good luck!','http://answers.webmd.com/answers/5040226/is-mineral-water-good-for-your-diet'),
 (137,'i am confused because my dr says to stay on a low protein diet because my ammonia level is 151. . however my total protein test is low at 5. 6 won\'t this effect my total protein result?','usually when ammonia is high there is trouble with the liver since it is the organ that breaks down protein to ammonia. it is no longer standard practice to subscribe very low protein diets with liver disease (i\'m not sure how much your doctor is recommending). the key is to eat the right amount of protein -- not too much but not too little. the total protein measures the amount of protein in the blood which could be affected by your diet. i recommend seeing a registered dietitian who can explain to you the amount of protein you need and how it relates to all of your blood levels. read more: total serum protein ammonia blood test','http://answers.webmd.com/answers/5039995/i-am-confused-because-my-dr-says-to-stay-on-a-low-protein-diet-because-my-ammonia-level-is-151'),
 (138,'can you please tell me daily doses for vitamins and daily servings of foods to increase low blood platelet counts?','low platelets also called thrombocytopenia happen for a variety of reasons such as certain diseases and medications. the way to correct it is to treat the reason it is occurring by working with your doctor. in some cases deficiencies of vitamin b12 and folate can be the cause so supplements may be recommended. there is no one diet or specific foods that has been shown to increase platelets. for more on thrombocytopenia see this webmd article.','http://answers.webmd.com/answers/5041350/can-you-please-tell-me-daily-doses-for-vitamins-and-daily-servings-of-foods-to-increase-low-blood-platelet-counts'),
 (139,'do i have ibs? 3 bowel movements a day. i\'m a 20 year old male and lately i have been having about 3 small(not too small but smaller) bowel movements daily usually after each meal. . i eat a lot of fiber 35-40 grams per day and usually drink a lot of water. is this normal for my high fiber/lots of water diet or is this progression a sign of me possibly developing ibs or colitis? . for the record this bowel movement increase does coincide with a rise in my fiber intake prior to the rise i usually had a bowel movement daily.','only a doctor can diagnose you with ibs or another related gastrointestinal disorder. but from what you have shared it seems your increase in bowel movements is due to your increase in fiber. especially if you are not feeling abdominal pain or bloating and your bowels are not hard or really loose. for more on the symptoms of ibs see this webmd article. if your daily bowel movements are due to increasing your fiber as i suspect your bowels will likely evolve to less frequent as your body adapts. if you feel something is wrong though don\'t hesitate to see your healthcare provider. best of luck to you!','http://answers.webmd.com/answers/5036413/do-i-have-ibs-3-bowel-movements-a-day'),
 (140,'does sugar feed cancer?','according to the american cancer society\'s website: \"no sugar intake has not been shown to directly increase the risk of getting cancer or having it get worse (progress). still sugars and sugar-sweetened drinks add large amounts of calories to the diet and can cause weight gain which we know can affect cancer outcomes. \" it makes sense to eat a healthy whole food based diet with cancer which would naturally be low in added sugars but no one can say for sure if it feeds cancer. for more on diet see this webmd article. the american caner association is either being extremely negligent evasive or just plain ignorant when it comes to cancer. according to german doctor otto wartberg the \"crux of his nobel thesis was that malignant tumors frequently exhibit an increase in anaerobic glycolysis -- a process whereby glucose is used as a fuel by cancer cells with lactic acid as an anaerobic byproduct -- compared to normal tissues. 1 the large amount of lactic acid produced by this fermentation of glucose from cancer cells is then transported to the liver. this conversion of glucose to lactate generates a lower more acidic ph in cancerous tissues as well as overall physical fatigue from lactic acid buildup. 2 3 thus larger tumors tend to exhibit a more acidic ph. 4 this inefficient pathway for energy metabolism yields only 2 moles of adenosine triphosphate (atp) energy per mole of glucose compared to 38 moles of atp in the complete aerobic oxidation of glucose. by extracting only about 5 percent (2 vs. 38 moles of atp) of the available energy in the food supply and the body\'s calorie stores the cancer is \"wasting\" energy and the patient becomes tired and undernourished. this vicious cycle increases body wasting. 5 it is one reason why 40 percent of cancer patients die from malnutrition or cachexia. 6 hence cancer therapies should encompass regulating blood-glucose levels via diet supplements non-oral solutions for cachectic patients who lose their appetite medication exercise gradual weight loss and stress reduction. professional guidance and patient self-discipline are crucial at this point in the cancer process. the quest is not to eliminate sugars or carbohydrates from the diet but rather to control blood glucose within a narrow range to help starve the cancer and bolster immune function. \" to read more go to the april 2000 issue of nutrition science news or www. mercola. com/article/sugar/sugar_cancer.','http://answers.webmd.com/answers/5037277/does-sugar-feed-cancer'),
 (141,'how does chemo effect blood sugar levels? . the morning after chemo treatment my blood sugar was 208 i\'m usually in range under 120 with an occasional 140. my type 2 diabetes is diet controlled.','some chemo drugs can elevate blood sugar levels. it\'s important to talk to your doctors about whether or not you need to add medication during your cancer treatment to help keep blood sugars controlled. good luck!','http://answers.webmd.com/answers/5037028/how-does-chemo-effect-blood-sugar-levels'),
 (142,'how to eat flax seeds','one of the easiest and convenient ways to add flax-seeds to your diet is by using flax-seed meal. most grocery stores sell it -- the seeds are already ground up for you. simply add spoonfuls to cereal like oatmeal baked goods (like pancakes and muffins) and in smoothies. it really doesn\'t have a taste (a bit nutty) and it\'s a great way to get more omega-3 fatty acids and fiber. for more recipes and info on the benefits of flax-seeds see this webmd article.','http://answers.webmd.com/answers/5037375/how-to-eat-flax-seeds'),
 (143,'despite regular cardio exercise and eating healthy i can\'t seem to lose weight? . okay maybe i can\'t lose weight is misleading but i am losing muscle and gaining fat. my exercise includes running for an hour at least four times a week for over a month and eating includes eating salads eggs fruits and white meats like chicken (and none of the junk i won\'t even allow myself cheat days). in spite of the fact that i have lost 20lbs i don\'t look any thinner. in fact i\'ve gained fat and it\'s becoming increasingly harder to continue keep the same running time and pace.','it sounds like you are losing weight and your body is changing. here are some tips that might help: consider working with a certified personal trainer to help you incorporate strength training exercises to help build muscle while monitoring your body fat. try yoga as another way to build muscle mass. eat some protein with small amounts of carbohydrate after working out to help stimulate muscle growth (e. g. protein bar peanut butter on whole wheat toast greek yogurt with almonds). see this article for more on what to eat before and after workouts eat balanced meals which includes all the food groups -- fruit vegetables healthy fats whole grains low fat dairy and lean protein. a registered dietitian can help you develop an eating plan that helps you lose weight in a healthy way. to find one go to eatright. org even though it\'s hard try to be patient. it takes time to find a healthy lifestyle that works for you. get the support you need! i would suggest you visit this site - how to get ripped. there you can find a customized nutrition and weight training plan based on details you fill in. like age weight height metabolism and body type. you can also read my story it contains information about my struggle. meybe you will find it heplful. good luck the body responds to what is known as the said principle. specific adaptations to imposed demands. when you look at marathon runners they are generally thin but actually have a higher body fat % than sprinters. this is an adaptation when you run for long periods your body needs energy. if your exercise program has no variation your body adapts and begins to hold on to it\'s fat so that it has energy stores to be used during long runs. running/cardio is fine but mix in resistance training. muscle burns more calories than fat. this doesn\'t mean you will get bulky if that\'s a concern but by activating more muscle fibers your body will burn more calories helping to lose weight. circuit training can be a useful tool for this you will burn a lot of calories your heart rate will get up and you will increase muscle. the key is variation most personal trainers or at least good ones progress your workout through different stages to keep your body adapting. using simple tools like exercise selection # of sets # of reps time of rest in between can all help. one final piece of advice most supplements out there are junk. don\'t waste your money on false promises. a registered dietician can help you with meal planning if you need it. hope this helps if anyone want to loose the weight than exercise is the best way for him/her to losse the weight or to maintain the body. but in this busy life sometimes we wont get the time to do the workout or jogging etc. many people are asking here that without doing exercise we can loose the weight. there are many ways through which you can loose the weight one of the way to loose the weight is eat healthy and fresh food drink the healthy tea like green tea. green tea benefits-it is healthy tea it helps one for lossing weight is also helps to cure from diseases. so i think now you know that without doing the exercise you can also loose your weight by maintaining your diets by taking healthy food. you may be losing inches! not just lowering your number on the scale! <positive_smiley>','http://answers.webmd.com/answers/5037403/despite-regular-cardio-exercise-and-eating-healthy-i-cant-seem-to-lose-weight'),
 (144,'if you have had most of large intestine removed could you develop a vitamin definciency? how would that be detected?','even though the small intestine eventually adapts to the loss of the large intestine it is possible to have a nutrient deficiency or become dehydrated. it\'s a good idea to take a multivitamin drink adequate fluids and get blood work done per your gastro-intestinal (gi) doctor\'s recommendation. common nutrient (vitamin and minerals) deficiencies they would check for through blood tests include iron (anemia) b vitamins like b12 and vitamin d. be sure to check with your doctor on the type of tests you need.','http://answers.webmd.com/answers/5039081/if-you-have-had-most-of-large-intestine-removed-could-you-develop-a-vitamin-definciency-how-would-that-be-detected'),
 (145,'will niacin raise blood sugar?','when the amounts of niacin taken exceed 3 grams (3000 mg) one of the potential side effects is high blood sugar. do not take such high levels without a doctor\'s supervision. for more on uses dosage and side effects see this webmd page. good luck!','http://answers.webmd.com/answers/5036950/will-niacin-raise-blood-sugar'),
 (146,'finger tips crack/malnutrition? . my daughter has had problems with eating disorders for at least 15 years. her hair is getting thin and i wondered if the cracking of her finger tips could be a sign of not enough fat in her diet. she eats only about 3-5 grams of fat per day on an average. she is 32 years old. periods late. she did have a healthy child 3 years ago but has been unable to conceive again. she doesn\'t binge and purge. she\'s 5\'5\" and about 105 lbs. we had her at counseling when she was a teen but nothing works.','yes brittle nails is a sign of inadequate nutrition along with thinning hair low body weight irregular or missed periods and always feeling cold. her diet does not sound adequate in fat or calories. it sounds like your daughter needs help before she would even consider having another child. maybe now that she is older and is a mom she can see the benefit of getting help. so i highly recommend encouraging her to go for treatment. for more on signs of an eating disorder/malnutrition see this webmd article.','http://answers.webmd.com/answers/5032235/finger-tips-crackmalnutrition'),
 (147,'does microwaving infant formula destroy all the nutrients? . my boyfriend and i have been microwaving the formula for a few seconds just enough to make it warm. i mostly breast feed but i have had problems producing enough milk so when we supplement with formula we microwave it. my mom says it kills all the nutrients i say i don\'t think it does but im not a doctor! please help. i want to know so that if it does kill the nutrients i can stop doing that and do it a different way that will benefit my child.','most helpful answer heating formula in the microwave will not destroy the nutrients but it is not recommended. the reason is it does not heat the milk evenly potentially resulting in milk that is hot in some areas and cold in others. a better way to warm up formula is by running it under warm water or placing it in a bowl of hot water for a few minutes. just make sure the bottle is not to hot when you give it to your baby. congratulations on your baby','http://answers.webmd.com/answers/5031925/does-microwaving-infant-formula-destroy-all-the-nutrients'),
 (148,'i am restricting food and i\'ve been feeling exhausted as well as having a low pulse. does this mean i\'m anorexic? . i still have my period and i haven\'t been working out that much though.','most helpful answer it is difficult to say whether or not you have anorexia based on the limited information you provide but what you are doing is problematic and could lead to an eating disorder. the signs and symptoms of anorexia include but are not limited to restricting food fear of gaining weight body weight of 85% ideal or less and exercising too much. here are more of the signs including physical symptoms. i suggest you get a physical and take care of yourself. if you are asking the question it is likely you could use some support either form a dietitian or psychologist who specializes in eating disorders. while you may not have an eating disorder disordered eating (eating too much or too little/obsessing about food) is very common and can have negative effects. don\'t delay getting help! your health and well being depend on it.','http://answers.webmd.com/answers/5032163/i-am-restricting-food-and-ive-been-feeling-exhausted-as-well-as-having-a-low-pulse-does-this-mean-im-anorexic'),
 (149,'i notice that sugars are supposed to be under 25 grams per day. how is that possible when milk has 7 grams per glass? . isn\'t it best to get your calcium from foods rather than supplements? how can you eat any sugar at all and still meet the guidelines when you have 3 cups of milk per day for your health?','the types of sugar people should limit in the diet are added sugars. sugars that are naturally occurring in milk yogurt and fruit would not count. added sugars would be the sugar that is added to a meal or drink (sugar to coffee or syrup on pancakes) or the addition of sweeteners during processing (granola/energy bars and soda). you can check the ingredient line for sources of added sugars such as brown rice syrup high fructose corn syrup malt syrup molasses corn sweetener honey syrup evaporated cane juice and fruit juice concentrate. for more on added sugars see this webmd article detailing the american heart association recommendations.','http://answers.webmd.com/answers/5034112/i-notice-that-sugars-are-supposed-to-be-under-25-grams-per-day-how-is-that-possible-when-milk-has-7-grams-per-glass'),
 (150,'what happens when glucose levels go over 250? my husband\'s is reading 500. he was recently diagnosed with diabetes.','500mg/dl is a very high blood glucose that needs attention from a health professional. the american diabetes association recommends the following blood glucose levels for people with diabetes: 70 to 130 mg/dl before meals and less than 180 mg/dl after meals. when blood sugar levels remain too high ketoacidosis can result (click on the link for more info) but that is more likely to occur in someone with type 1 diabetes. over time having high blood sugars puts people at risk for various complications. it\'s important you work with your doctor to lower your blood glucose level as is working with your dietitian/diabetes educator to make changes to your meal plan and/or medication. don\'t delay getting help! there is quite a learning curve when diabetes is first diagnosied but once you get it it will become easier. for more on blood sugar control see this webmd article','http://answers.webmd.com/answers/5034496/what-happens-when-glucose-levels-go-over-250-my-husbands-is-reading-500-he-was-recently-diagnosed-with-diabetes'),
 (151,'just as there is \"good\" cholesterol (hdl) and \"bad\" cholesterol (ldl) there are also \"good\" triglycerides. explain? . i recently was made aware of good triglycerides. so i did some research and found this paper online <link> can a medical professional or scientist please explain what triglyceride remnants means in layman terms. need clarification on t\"he mechanisms by which \"bad\" triglycerides develop explain why elevated triglycerides and low hdl--and patients with the metabolic syndrome--warrant special attention\" why is this?','none of the major health organizations emphasize good or bad triglycerides -- the study you found was from 2002 and i have found nothing more recent to support it. the key is to think of heart disease risk like a puzzle with many different pieces. risk factors include high triglycerides high total cholesterol high ldl (bad cholesterol) and low hdl (good cholesterol) high blood pressure hyperglycemia and abdominal fat. someone with metabolic syndrome has a cluster of all these risk factors (instead of just one or two) putting them at even higher risk. for more on how to lower triglycerides see this article and for more on optimal blood lipid levels see this one. good luck!','http://answers.webmd.com/answers/5034625/just-as-there-is-good-cholesterol-hdl-and-bad-cholesterol-ldl-there-are-also-good-triglycerides-explain-'),
 (152,'is there a special diet for acid reflex?','while there isn\'t one diet for reflux there are some general diet recommendations. first you want to avoid caffeine found in beverages like coffee and tea and foods like chocolate. alcohol often makes reflux worse so keep intake minimal. you\'ll also want to note which foods make your symptoms worse. common triggers include fatty foods spicy foods citrus fruits and products made with tomatoes. some people can eat small amounts of certain items without an issue. keep a food journal to be sure. for other lifestyle changes you can make see this webmd article.','http://answers.webmd.com/answers/5039650/is-there-a-special-diet-for-acid-reflex'),
 (153,'total cholesterol 268- triglycerides 238- hdl 49- vldl cholest cal 48- ldl 171- are these counts serious?','according to the american heart association a total cholesterol over 240 doubles your risk of heart disease compared to someone with a total cholesterol of 200. what adds to your risk is your high triglycerides combined with a high ldl (bad cholesterol). your hdl doesn\'t put you at increased risk but having a high hdl (60 or higher) is protective against heart disease. so yes you should take these numbers seriously. the good news is there\'s much you can do to improve your numbers including eating a healthy diet exercising and watching added sugars and alcohol consumption. for cholesterol basics see this article and for more on what those numbers mean see this one. take care of yourself!','http://answers.webmd.com/answers/5034711/total-cholesterol-268-triglycerides-238-hdl-49-vldl-cholest-cal-48-ldl-171-are-these-counts-serious'),
 (154,'does dry mouth often go along with constipation?','while dry mouth is not considered a symptom of constipation it could be related because inadequate fluid/water intake is often one of the causes of hard stools. if the body needs more water it will reabsorb it from the stool in the colon making it more hard and dry. for more on constipation signs and causes see this webmd article.','http://answers.webmd.com/answers/5034236/does-dry-mouth-often-go-along-with-constipation'),
 (155,'with gastroparesis: is liquid food like jevity good? already follow jackson siegelbaum diet for gastroparesis.','jevity is typically used as a tube feeding but other oral supplements like ensure or glucerna (if you are diabetic) can be used. the jackson siegelbaum diet has three steps the first being liquids. there may be times you go back to liquids when symptoms worsen. liquids and low fiber foods tend to be tolerated the best for people with gastroparesis. oral supplements also make sense when weight and nutrition is a concern due to inability to eat regular meals. if you are concerned about your nutrition you can always see a dietitian -- you can find one at eatright. org. for more on diet for gastroparasis see this webmd article. good luck!','http://answers.webmd.com/answers/5039386/with-gastroparesis-is-liquid-food-like-jevity-good-already-follow-jackson-siegelbaum-diet-for-gastroparesis'),
 (156,'how much biotin should i take to loose weight? . i have a back injury so i need something that will help me loose weight.','although biotin plays a role in metabolism there are no studies to show it helps with weight loss. the key for weight loss is to make changes to diet and exercise. you can see a registered dietitian (go to eatright. org) or you can create your own plan here. for more on biotin uses see this webmd article. good luck!','http://answers.webmd.com/answers/5035479/how-much-biotin-should-i-take-to-loose-weight'),
 (157,'will multi vitamin help with celiac disease? . my husband has been on a gluten free diet for celiac disease less than a week. i want to start him on a multivitamin but it will not work until the small intestine is healed enough to absorb the vitamins. question: how long after starting gluten free diet will the small intestine start to absorb nutrients?','there is no reason to wait to introduce a multivitamin as symptoms of celiac disease usually improve in a few days to weeks and this means absorption of nutrients increases as well. it will take longer for the intestines to completely heal and studies shows this varies from individual to individual (can take 2-5 years in adults and some may not experience full regeneration of the intestinal villi). it\'s also beneficial to get lab work done to see if there any specific nutrient deficiencies such as iron folic acid and vitamin d. in some cases additional supplementation will be needed. always consult your doctor. for more on diet and supplements for celiac disease see this webmd article.','http://answers.webmd.com/answers/5028872/will-multi-vitamin-help-with-celiac-disease'),
 (158,'should i give my 3 year old omega 3 supplement on top of her pediatrician prescribed vitamin?','it depends on if your child is getting some through her diet. if she is eating fish at least twice a week she doesn\'t need to supplement with omega 3s. but if she eats no fish then it is unlikely she is getting enough docosahexaenoic acid (dha) and eicosapentaenoic acid (epa) which plays an important role in brain development. when looking at supplements check the specific amount (milligrams) of dha and epa in the product. the world health organization recommends 2-4 year old\'s get 100-150 milligrams of dha and epa (combined) daily. studies show most children only get 45 milligrams. always check with your healthcare provider.','http://answers.webmd.com/answers/5028527/should-i-give-my-3-year-old-omega-3-supplement-on-top-of-her-pediatrician-prescribed-vitamin'),
 (159,'can being over weight cause arthritis in your feet?','while excess weight doesn\'t necessarily cause arthritis in places like your feet it can exacerbate it or make it progress in a more rapid fashion. excess weight puts additional stress on joints making arthritis symptoms worse. losing weight will not cure arthritis but it can help slow down the progression of the disease. for more details on how this works see this webmd article. weight bearing joints like knee and ankle are most likely affected by arthritis. being overweight is a known risk factor of arthritis and even putting on 10 pounds may worsen the arthritis. while treating arthritis in obese and overweight individuals weight loss is considered as an important strategy.','http://answers.webmd.com/answers/5029335/can-being-over-weight-cause-arthritis-in-your-feet'),
 (160,'can the paleo diet raise my cholesterol. my wife is on the paleo diet and i have joined her (to some degree). i eat two eggs every morning along with 2 pieces of bacon. i use coconut oil along with real butter to cook with. could these factors be raising my cholesterol?','research shows that over the short-term low carbohydrate/high protein diets have beneficial effects on blood lipids especially raising the good kind of cholesterol hdl. it\'s important to note that some of the benefits seen in cardiovascular risk factors may be due to the weight loss that accompanies such diets. there isn\'t much data regarding the long-term effects on cholesterol especially ldl. some of the foods avoided on paleo help keep cholesterol (ldl) down such as oats and beans. so it is possible that your cholesterol could go up especially once you are done losing weight. i recommend getting lab work done so you can track your blood lipid levels. best paleo recipes books for good health<link>','http://answers.webmd.com/answers/5028268/can-the-paleo-diet-raise-my-cholesterol'),
 (161,'in the morning before i leave for work should i eat before exercising & how long do i wait before i start exercising? . i want to excersise in the moring before i leave for work but i am unsure if i should eat before exercising and if i eat should i wait before i start exercising. .','while it\'s a good thing to eat before exercise eating in the morning will depend upon how much exercise you are getting. if you are going for a 30 minute run first thing you may be able to skip it. but if you are working hard for over an hour you\'ll need some energy such as a carbohydrate-rich small banana toast or half of an energy bar. try different strategies to see what works best for you. does that fuel first thing give you more energy? or does it bother your stomach? with time and trial and error you\'ll figure it out. see this webmd article for more on what to eat before during and after exercise congrats on your commitment to exercise!','http://answers.webmd.com/answers/5034793/in-the-morning-before-i-leave-for-work-should-i-eat-before-exercising-how-long-do-i-wait-before-i-start-exercising'),
 (162,'why am i always hungry? . i am a 17 year old girl and i\'m always hungry. i primarily eat healthy. no soda or chips. i eat 3-5 full meals a day. i eat oatmeal fruit veggies and meat. i drink over 10 glasses of water a day. i don\'t gain weight. i am 5\'8 and 130lb. i am physically active. why am i so hungry? what can i do to stay full longer?','most helpful answer here are some tips on how to stay full longer: make sure you get plenty of fiber to meals. fiber is found in fruits vegetables and whole grains. beans are really high in fiber and make great additions to salads and are good as a side dish. protein is also very filling so include a source at each meal -- nut butters meat eggs beans (fiber and protein) and tofu are all good sources. fat is very satisfying and adds extra calories so make sure you have a fat source at each meal. that might be nuts on your oatmeal avocado on a salad or sandwich or olive oil when roasting veggies. healthy fats such as those from plants and fish are the best health wise. dairy and/or non-dairy alternatives are important as your calcium needs are high. try greek yogurt with nuts milk in your oatmeal and cheese in sandwiches and mixed dishes. the key is to add as many food groups as possible for satisfaction nutrition and to manage your hunger. for more ideas see this webmd article.','http://answers.webmd.com/answers/5030239/why-am-i-always-hungry'),
 (163,'does biotin help reduce lactic acid build up. i started kick boxing and doing a lot more activity in an effort to get back into shape. i was told biotin would help break down the lactic acid build up in my muscles','although biotin does play a role in amino acid metabolism there are no studies (that i can find) that show taking biotin decreases lactic acid production. if someone is deficient in biotin it could limit performance or muscle formation but that is unlikely. if you are getting enough through diet you probably don\'t need to supplement. for more on lactic acid and biotin see these articles: exercise and lactic acidosis biotin supplement guide','http://answers.webmd.com/answers/5034670/does-biotin-help-reduce-lactic-acid-build-up');
